       id="text262"><tspan
         x="0 5.2820001 10.032 16.891001 22.695499 26.391001 32.195499 34.836498 39.054501 41.961498 50.407001 55.688999 58.330002 60.971001 66.252998 74.698502 77.605499 83.942001 89.746498 95.551003 101.3555 106.6375 112.442 116.1375 119.0445 125.9035 131.1855 135.9355 141.2175 144.1245 149.929 155.73351 158.6405 164.44501 170.2495 173.94501 179.22701 185.03149 187.6725 191.368 196.64999 199.55701 206.416 211.698 216.448 221.73"
         y="0"
         id="tspan244">PzNordic mellem Kongens Have og Botanisk Have </tspan><tspan
         x="0 5.2820001 11.0865 19.532 25.3365 27.977501 33.782001 39.063999 42.759499 48.0415 51.737 54.644001 60.448502 65.730499 69.426003 72.333 78.137497 83.419502 89.223999 92.919502 96.614998 101.897 104.804 108.4995 112.195 117.477 120.384 124.0795 129.884 132.791 141.2365 146.51849 152.323 156.01849 159.714 164.996 170.80051 173.4415 177.13699 179.778 185.5825 191.38699 196.66901 199.4924 202.13341 205.04041 210.84489 216.12691 224.5724 227.21339 229.8544 235.65891"
         y="12.996"
         id="tspan246">kombinerer det bedste fra to madtraditioner, nemlig </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 19.798 22.438999 26.134501 31.4165 34.057499 36.698502 41.980499 47.785 51.480499 56.762501 62.044498 64.9515 70.755997 76.560501 79.467499 85.272003 90.554001 96.358498 99.265503 105.07 110.8745 114.57 120.3745 123.0155 126.711 131.993 137.27499 139.916 142.823 149.68201 154.964 157.871 161.5665 167.371 170.278 175.56 178.201 183.483 187.1785 192.46049 195.1015 198.0085 204.86749 210.14951 214.89951 217.5405 223.345 228.627"
         y="25.992001"
         id="tspan248">den italienske og den nordiske. De to ejere, Davide </tspan><tspan
         x="0 8.9680004 14.25 20.054501 25.3365 31.141001 36.945499 41.163502 46.967999 49.875 55.679501 61.484001 64.390999 73.359001 79.163498 82.859001 86.554497 91.836502 97.640999 100.548 105.298 108.9935 113.7435 119.548 124.83 130.63451 134.33 140.13451 145.4165 148.0575 150.6985 153.6055 159.41 163.1055 171.55099 177.3555 183.16 188.442 192.1375 195.04449 198.74001 204.54449 208.24001"
         y="38.987999"
         id="tspan250">Maganuco og Morten Frydensdal, brænder for </tspan><tspan
         x="0 5.8045001 11.609 17.4135 21.108999 29.554501 34.836498 38.532001 44.336498 46.977501 51.727501 56.477501 61.759499 64.400497 67.307503 73.112 78.393997 82.0895 84.996498 88.692001 93.973999 96.614998 100.3105 104.006 109.288 112.9835 115.8905 121.1725 123.8135 127.509 130.416 135.698 139.39349 143.089 148.371 151.1944 153.8354 156.7424 162.54691 167.29691 169.9379 172.5789 177.8609 183.1429 188.9474 191.8544 195.5499 200.83189 204.5274 209.2774 214.5594"
         y="51.984001"
         id="tspan252">gourmetpizza, der skifter alt efter, hvilken farve </tspan><tspan
         x="0 3.6954999 12.141 15.8365 21.641001 27.445499 32.727501 38.532001 42.227501 45.134499 50.938999 53.580002 58.862 64.666496 69.948502 72.855499 78.660004 83.942001 87.637497 90.544502 96.348999 102.1535 107.4355 110.3425 116.147 121.429 124.336 128.03149 131.72701 140.1725 145.4545 149.14999 154.9545 160.2365"
         y="64.980003"
         id="tspan254">sæsonens blade har ude på træerne.</tspan><tspan
         x="0 4.75 10.5545 14.25 19 24.282 30.0865 33.782001 36.688999 39.330002 45.134499 50.938999 54.634499 59.9165 65.721001 68.362 73.643997 79.448502 83.143997 88.426003 92.121498 95.028503 98.723999 104.5285 112.974 115.881 121.6855 125.381 129.07651 134.35851 138.054 141.7495 147.554 152.836 156.53149 160.22701 165.509 171.31351 177.118 180.81351 186.0955 188.7365 191.64349 197.448 201.14349 209.589 215.39349 221.198 224.89349"
         y="77.975998"
         id="tspan256">Forvent ingredienser som østershattepuré, brændt </tspan><tspan
         x="0 5.8045001 11.609 15.3045 19 24.282 27.977501 31.673 37.477501 42.227501 45.134499 50.938999 56.7435 59.650501 63.346001 68.096001 70.737 74.432503 79.7145 85.518997 90.801003 93.708 97.403503 102.6855 108.49 113.772 117.4675 123.272 128.554 131.3774 134.0184 136.9254 141.6754 146.9574 152.7619 158.0439 163.8484 166.7554 172.55991 177.8419 181.5374 184.4444 190.2489 196.05341 198.9604 202.6559 205.29691 210.5789 215.8609 221.1429 224.83839 228.53391"
         y="90.972"
         id="tspan258">porrestøv og syltede rabarber. Sådan har du sikkert </tspan><tspan
         x="0 2.641 7.9229999 13.205 18.487 21.393999 25.0895 30.3715 35.6535 39.348999 42.256001 48.060501 50.7015 56.506001 59.412998 65.217499 67.858498 72.608498 77.358498 82.640503 85.547501 89.242996 95.047501 97.869949"
         y="103.968"
         id="tspan260">ikke fået din pizza før.</tspan></text>

         y="0"
         id="tspan272">Bæst laver et, ja bæst af en pizza. Sådan må det </tspan><tspan

       id="text296"><tspan
         x="0 3.6954999 7.3909998 13.1955 16.891001 22.173 25.08 28.775499 34.057499 37.752998 41.448502 46.730499 52.535 56.230499 61.512501 67.317001 71.012497 73.919502 79.723999 85.005997 90.810501 96.614998 101.897 105.5925 108.4995 114.304 120.1085 123.804 126.445 130.1405 133.836 136.47701 141.759 147.56351 150.4705 155.7525 161.55701 167.3615 170.0025 172.64349 176.339 178.98 181.621 184.528 193.496 198.778 204.5825 207.4895 211.185 213.826 219.63049 224.91251"
         y="0"
         id="tspan282">store restaurant hedder Christian Puglisi. Med sine </tspan><tspan
         x="0 2.641 6.3365002 11.6185 14.2595 16.900499 22.182501 27.987 31.682501 36.9645 42.246498 45.1535 48.848999 54.6535 60.458 66.262497 71.544502 75.239998 78.147003 83.9515 89.233498 92.929001 95.835999 101.6405 106.9225 112.727 115.634 120.916 126.7205 129.6275 133.323 137.01849 142.823 145.464 149.1595 154.964 160.246 166.05051 168.9575 174.76199 179.51199 184.79401 188.4895 191.3965 195.092 200.8965 204.592"
         y="12.996"
         id="tspan284">italienske rødder har han en stolthed over for </tspan><tspan
         x="0 3.6954999 8.9775 13.7275 19.009501 22.705 27.987 31.682501 37.487 42.769001 45.675999 49.371498 55.175999 63.621498 66.528503 70.223999 75.505997 78.413002 83.695 89.499496 95.304001 98.999496 104.2815 107.1885 109.8295 112.7365 117.4865 122.7685 126.464 132.26849 137.55051 143.355 145.996 148.903 152.5985 157.88049 160.5215 163.4285 166.0695 168.9765 173.7265 179.0085 182.70399 188.5085 193.7905 199.595 202.23599 205.14301 210.94749 219.39301 223.0885 226.784 230.47951"
         y="25.992001"
         id="tspan286">råvarerne som få andre i verden. Ja, i verden. Bæsts </tspan><tspan
         x="0 5.8045001 8.4455004 13.1955 17.945499 23.227501 26.134501 31.4165 35.112 38.019001 41.7145 44.355499 49.637501 53.333 58.615002 61.521999 67.3265 72.608498 78.413002 84.217499 89.499496 92.406502 96.101997 99.797501 105.0795 113.525 117.2205 120.1275 122.7685 128.573 134.3775 137.2845 140.98 146.7845 155.23 158.13699 163.41901 169.2235 172.13049 177.41251 181.108 184.015 188.765 194.047 197.74249 203.547 208.82899 214.6335 218.32899"
         y="38.987999"
         id="tspan288">pizza er flere gange stemt ind som en af verdens </tspan><tspan
         x="0 5.2820001 10.564 13.471 19.275499 24.557501 30.362 34.057499 37.752998 43.035 45.942001 51.746498 54.387501 59.137501 63.887501 69.169502 74.4515 77.273949 79.914948 82.821953 89.680946 94.962952 98.658447 103.94045 107.63595 110.54295 116.34745 120.04295 122.68395 125.32495 127.96595 133.24796 139.05244 144.33446 147.24146 153.04594 158.85045 164.65495 170.45946 173.36646 179.17094 181.81195 186.56195 191.84395 195.53944 198.44646 204.25095 209.53294 215.33745"
         y="51.984001"
         id="tspan290">10 bedste pizzaer. Deres grillede bund giver den </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 20.5865 24.282 29.563999 32.471001 38.275501 43.557499 47.252998 52.535 55.442001 59.137501 64.942001 68.637497 71.544502 77.348999 82.630997 86.3265 91.608498 95.304001 98.210999 103.493 109.2975 114.5795 120.384 126.1885 129.884 135.68851 141.493 147.2975 151.5155 156.7975 160.493 165.77499 171.5795 176.8615 179.76849 183.464 188.746 193.496 198.778 202.4735 207.75549 211.451 214.358 218.0535 223.858 232.3035"
         y="64.980003"
         id="tspan292">bedste base for deres egenproducerede råvarer som </tspan><tspan
         x="0 4.2179999 10.0225 15.3045 19 23.218 29.022499 32.717999 38 41.695499 44.336498 47.2435 53.048 58.852501 61.759499 67.564003 71.259499 74.955002 80.237"
         y="77.975998"
         id="tspan294">charcuteri og oste.</tspan></text>
    <text

         id="tspan308">specialiseret sig i de hvide pizzaer. Det betyder, at </tspan><tspan

         y="25.992001"
         id="tspan310">man kan få sin yndlingsspise uden den traditionelle </tspan><tspan
         x="0 3.6954999 9.5 17.945499 23.227501 26.923 30.6185 35.900501 41.705002 45.923 51.205002 53.846001 56.752998 60.448502 66.252998 74.698502 77.605499 82.887497 85.528503 88.169502 93.4515 97.147003 100.8425 103.7495 109.554 115.3585 121.163 126.9675 130.66299 133.57001 139.3745 145.179 150.98351 156.78799 162.07001 167.8745 170.78149 173.4225 176.3295 184.77499 190.05701 195.8615 201.666 206.948"
         y="38.987999"
         id="tspan312">tomatsauce, som ellers udgør bunden i mange </tspan><tspan

         y="51.984001"
         id="tspan314">pizzaer. Bunden er sprød og knasende, og der er et </tspan><tspan

         y="12.996"
         id="tspan332">Deres mest brugte våben er de Valoriani-pizzaovne, </tspan><tspan

         y="25.992001"
         id="tspan334">de har fået installeret, og som bager den ene </tspan><tspan
         x="0 3.6954999 9.5 13.1955 19 24.804501 30.0865 32.727501 35.634499 41.438999 46.721001 49.362 54.112 57.807499 63.612 69.416496 74.698502 80.502998 85.785004 88.692001 94.496498 97.137497 101.8875 106.6375 111.9195 117.724 123.5285 129.33299 135.1375 138.04449 143.32651 147.022 150.7175 155.9995 159.69501 162.60201 168.40649 173.68851 179.493 182.39999 187.68201 193.4865 199.291 204.573 210.3775 213.2845 218.0345"
         y="38.987999"
         id="tspan336">sprøde, halvrøgede pizzabund efter den anden – </tspan><tspan
         x="0 5.2820001 8.9775 12.673 17.955 21.650499 24.557501 30.362 33.002998 38.807499 42.502998 45.41 50.692001 54.387501 57.294498 65.739998 68.380997 74.185501 79.989998 83.685501 87.380997 90.288002 93.983498 96.624496 102.429 105.336 111.1405 116.945 122.7495 128.03149 131.72701 134.634 139.384 144.666 148.3615 156.80701 162.089 167.89349"
         y="51.984001"
         id="tspan338">efter blot et minuts tid under varmen.</tspan><tspan
         x="0 8.9680004 14.25 20.054501 22.9615 28.766001 34.570499 38.265999 40.907001 46.711498 50.407001 53.313999 59.1185 61.759499 65.455002 70.737 76.018997 79.7145 84.996498 87.903503 93.708 98.458 103.74 107.4355 110.3425 115.0925 120.897 126.179 129.8745 135.679 140.961 143.868 149.14999 152.8455 155.7525 161.55701 166.839 170.5345 173.4415 179.246 185.05051 188.746 194.028 196.935 202.7395 208.54401 214.3485 219.63049 223.326"
         y="64.980003"
         id="tspan340">Med udsigt direkte over Søerne er der også noget </tspan><tspan

       id="text374"><tspan
         x="0 8.9680004 14.7725 18.468 24.272499 29.554501 33.25 36.157001 38.798 41.705002 48.0415 53.846001 59.650501 65.455002 70.205002 75.487 81.291496 84.198502 89.480499 93.176003 96.083 101.365 105.0605 107.9675 113.2495 116.945 119.852 125.6565 130.40649 135.68851 141.493 145.18851 148.0955 151.791 154.43201 159.714 163.4095 168.6915 172.38699 176.0825 181.3645 184.2715 189.5535 195.358 199.0535 202.74899 205.39 208.297 214.1015 218.8515 221.49249 225.188"
         y="0"
         id="tspan354">Mother i Kødbyen er et af byens sikreste kort, hvis </tspan><tspan
         x="0 5.8045001 11.609 14.516 19.266001 21.907 24.548 27.455 31.150499 39.596001 44.877998 50.682499 55.9645 58.871498 64.676003 69.958 75.762497 78.669502 81.310501 85.005997 90.288002 92.929001 95.57 100.852 106.6565 110.352 115.634 120.916 123.823 129.6275 134.9095 138.605 141.246 147.05051 152.855 158.13699 160.778 164.4735 170.278 172.91901 176.6145 181.8965 184.53751 187.4445 193.24899 199.0535 204.858 210.66251 215.9445 221.74899 224.65601 229.938 233.6335"
         y="12.996"
         id="tspan356">du vil smage den italienske nationalspise. Bunden er </tspan><tspan
         x="0 3.6954999 7.3909998 12.673 21.1185 26.400499 29.0415 32.737 38.019001 43.300999 46.996498 49.9035 55.185501 58.881001 61.787998 65.483498 71.288002 74.983498 80.788002 86.07 88.710999 91.351997 94.259003 100.0635 104.8135 107.4545 110.0955 115.3775 120.6595 124.355 127.262 130.9575 136.2395 138.88049 143.63049 147.326 153.13049 155.7715 161.576 166.858 169.49899 172.14 177.9445 180.8515 186.1335 191.4155 197.22 200.127 203.82249 212.26801 217.55 223.35451 228.63651 232.332 234.97301"
         y="25.992001"
         id="tspan358">fremelsket af surdej, hvilket selvfølgelig kan smages. </tspan><tspan
         x="0 6.8590002 12.141 15.8365 18.7435 27.188999 32.471001 38.275501 41.182499 46.4645 50.16 55.9645 61.246498 63.887501 69.692001 74.973999 78.669502 81.5765 90.022003 95.304001 101.1085 104.0155 107.711 113.5155 117.211 123.0155 128.2975 130.93851 133.5795 136.4865 141.76849 145.464 148.371 154.17551 159.4575 163.153 166.06 171.342 173.983 177.6785 180.3195 186.12399 189.03101 194.313 200.11749"
         y="38.987999"
         id="tspan360">Når man arbejder med surdej, er der altid en </tspan><tspan
         x="0 8.4455004 14.25 20.054501 25.3365 28.86195 32.025452 35.720951 41.525452 45.220951 51.025452 56.307449 58.948448 61.589451 64.496452 70.300949 76.105453 79.012451 84.816948 90.098953 93.794449 96.701447 101.98345 105.67895 108.58595 112.28145 117.56345 122.84545 126.54095 129.18195 132.87746 138.15945 141.06645 146.87096 152.15295 154.97635 157.61736 160.52435 166.32886 171.61086 176.36086 182.16534 187.44736 191.14285 194.04985 203.01785 208.82236 212.51785 218.32236 223.60435 227.29985"
         y="51.984001"
         id="tspan362">moder-surdej, og det er faktisk her, navnet Mother </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 17.688999 22.971001 28.775499 32.471001 37.752998 41.448502 44.355499 48.050999 51.746498 57.0285 59.669498 62.5765 67.858498 70.499496 75.781502 79.476997 82.384003 89.242996 94.525002 99.275002 101.916 107.7205 110.6275 116.432 119.073 122.5994 126.2949 131.5769 137.38139 140.0224 142.9294 148.7339 154.0159 157.7114 160.61839 164.3139 166.9549 172.7594 178.0414 183.8459 186.7529 190.44839 196.2529 199.94839 203.64391 207.3394 212.6214"
         y="64.980003"
         id="tspan364">er hentet fra. Ejer David Biffani har siden første </tspan><tspan
         x="0 5.2820001 11.0865 16.891001 19.532 25.3365 31.141001 34.836498 40.640999 45.923 51.727501 54.634499 60.438999 65.721001 69.416496 73.112 76.018997 81.823502 90.268997 93.9645 97.660004 102.942 108.7465 111.6535 115.349 121.1535 123.7945 129.599 133.29449 136.20151 142.006 147.8105 151.506 154.147 157.054 162.85851 168.66299 171.57001 175.2655 181.07001 183.711 188.993 191.89999 195.5955 198.2365 204.041 209.323 214.605 219.88699 223.5825"
         y="77.975998"
         id="tspan366">åbningsdag haft næsten fuldt hus, og folk flokkes </tspan><tspan
         x="0 2.641 7.9229999 13.205 18.487 21.393999 27.1985 29.8395 35.644001 39.3395 42.246498 48.050999 56.496498 59.4035 65.208 70.489998 73.397003 79.2015 85.005997 90.810501 96.614998 99.255997 107.7015 111.397 116.679 119.586 125.3905 128.03149 132.78149 137.53149 142.81351 148.0955 150.9189 153.55991 156.4669 164.9124 170.1944 175.9989 178.9059 184.7104 189.4604 195.26489 200.54691 204.2424 207.1494 212.9539 218.75841 222.4539 227.7359"
         y="90.972"
         id="tspan368">ikke blot om de populære pizzaer, men nyder også </tspan><tspan
         x="0 5.8045001 11.609 17.4135 21.108999 24.016001 29.298 32.9935 35.900501 41.705002 46.987 49.894001 53.5895 58.871498 61.7785 67.583 76.028503 81.833 84.473999 89.223999 94.505997 97.147003 100.8425 106.1245 109.82 112.727 115.368 118.275 124.6115 130.416 136.2205 142.02499 146.77499 152.05701 157.8615 160.5025 163.4095 169.214 173.964 179.76849 183.464 186.371 194.8165 200.0985 205.903 208.81 214.6145 220.41901 224.1145 229.3965"
         y="103.968"
         id="tspan370">godt af de rå omgivelser i Kødbyen, hvor man også </tspan><tspan
         x="0 5.2820001 10.564 16.3685 19.275499 22.971001 25.612 31.4165 37.221001 42.502998 45.41 51.2145 57.019001 62.300999 68.105499 71.801003 77.605499 81.301003 84.208 90.012497 95.294502 98.2015 104.006 109.288 112.195 120.6405 125.9225 131.72701 137.53149 142.81351 145.7205 151.52499 159.9705 165.77499 171.05701 176.339"
         y="116.964"
         id="tspan372">kan sidde udenfor på de mange bænke.</tspan></text>

         x="0 6.8590002 9.5 12.141 17.423 20.33 26.134501 31.4165 35.112 38.019001 42.769001 48.050999 50.692001 53.598999 58.881001 64.685501 69.967499 75.772003 79.467499 82.108498 84.749496 90.554001 93.460999 99.265503 104.5475 110.352 116.1565 120.9065 123.8135 127.509 133.31351 137.009 139.916 145.7205 148.3615 153.1115 157.8615 163.14349 165.7845 168.6915 175.55051 181.355 186.63699 189.54401 192.185 195.092 201.951 207.75549 211.451 217.25549 222.00549 227.28751 230.983 234.6785"
         y="0"
         id="tspan384">Alle har vel egentlig behov for pizza. Ude i Nordvest </tspan><tspan
         x="0 3.6954999 8.9775 11.8845 20.33 25.612 31.4165 36.698502 40.394001 43.035 45.942001 51.223999 54.919498 57.8265 63.631001 68.913002 71.82 77.624496 82.906502 86.601997 89.509003 95.313499 101.118 106.4 111.682 114.323 120.1275 123.823 126.73 132.5345 137.8165 141.51199 146.79401 150.4895 153.3965 159.201 161.842 167.12399 170.8195 173.7265 179.0085 182.70399 186.39951 191.6815 195.377 198.284 204.0885 209.3705 213.06599 215.707 218.614 225.47301 230.755 234.4505"
         y="12.996"
         id="tspan386">så meget, at de har opkaldt deres biks efter det. Her </tspan><tspan
         x="0 5.2820001 10.564 16.3685 19.275499 27.721001 33.002998 38.807499 41.7145 46.996498 52.800999 58.605499 64.410004 69.692001 72.598999 76.294502 81.5765 90.022003 92.663002 97.945 101.1085 104.804 107.445 113.2495 116.413 121.695 127.4995 132.78149 138.586 141.7495 147.554 150.19501 154.94501 159.69501 164.97701 167.618 170.52499 176.3295 182.134 185.041 190.8455 196.1275 199.823 202.73 208.01199 211.7075 214.6145 217.25549 219.8965 225.701 230.983"
         y="25.992001"
         id="tspan388">kan man endda samle-sin-egen-pizza, og det er lige </tspan><tspan
         x="0 8.4455004 13.7275 19.532 24.813999 28.509501 31.150499 34.057499 39.862 44.612 50.4165 54.112 57.019001 65.4645 70.746498 76.551003 82.355499 87.637497 90.544502 94.239998 100.0445 105.849 111.6535 114.2945 120.099 125.9035 129.599 132.506 140.95151 146.23351 152.03799 154.94501 158.6405 167.086 169.72701 175.53149 180.81351 184.509 187.416 193.2205 198.5025 201.14349 204.05051 209.855 213.55051 216.1915 219.88699 225.16901 230.9735"
         y="38.987999"
         id="tspan390">meget, hvor mange toppings man smider på, prisen </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 17.688999 22.971001 28.775499 31.682501 35.377998 40.66 49.105499 57.550999 62.833"
         y="51.984001"
         id="tspan392">er den samme.</tspan><tspan
         x="0 4.75 10.5545 19 21.907 30.352501 35.634499 41.438999 44.346001 49.627998 53.323502 56.230499 62.035 67.8395 71.535004 74.442001 78.137497 81.833 87.114998 90.810501 94.505997 99.788002 103.4835 106.3905 114.836 120.118 125.9225 128.8295 132.52499 136.2205 141.5025 144.4095 150.214 156.01849 161.823 167.6275 172.9095 178.714 181.621 190.0665 195.3485 201.153 204.06 209.342 213.03751"
         y="64.980003"
         id="tspan394">Som med et hus starter man fra bunden med at </tspan><tspan
         x="0 4.75 13.1955 15.8365 21.641001 26.923 29.83 35.634499 40.9165 43.557499 46.198502 49.105499 54.387501 57.0285 62.310501 66.005997 69.7015 72.342499 76.038002 81.32 83.960999 86.867996 90.563499 96.367996 99.009003 104.8135 110.0955 115.9 119.5955 125.4 128.30701 133.589 136.23 138.871 144.153 147.8485 150.75549 156.56 159.201 165.00549 168.701 173.983 179.78751 183.483 187.1785 189.8195 192.46049 195.36749 200.11749 205.39951 208.3065 212.002 217.284 222.56599 225.207"
         y="77.975998"
         id="tspan396">vælge dej: klassisk, fuldkorn eller glutenfri. Så skal </tspan><tspan
         x="0 5.8045001 11.0865 14.782 17.688999 21.384501 26.6665 32.471001 37.752998 41.448502 44.355499 48.050999 51.746498 54.387501 57.0285 59.669498 62.310501 68.114998 73.919502 76.8265 80.522003 83.163002 85.804001 88.710999 92.406502 98.210999 104.0155 106.6565 109.5635 115.368 120.118 122.759 128.56351 131.4705 136.7525 139.39349 142.0345 147.3165 151.01199 153.91901 159.7235 163.41901 169.2235 175.028 177.935 181.63049 186.91251 192.717 196.935 202.217 205.12399 210.9285 216.733"
         y="90.972"
         id="tspan398">der tages stilling til rød, hvid eller grøn sauce og </tspan><tspan
         x="0 5.8045001 11.0865 14.782 20.5865 29.032 32.727501 36.423 39.330002 45.134499 48.830002 52.525501 57.807499 63.612 66.252998 69.160004 71.801003 77.605499 83.410004 88.692001 94.496498 97.403503 105.849 111.131 116.9355 119.8425 125.647 130.929 134.6245 137.53149 141.22701 144.9225 147.56351 151.259 154.166 158.916 164.198 166.839 172.64349 175.55051 178.1915 181.0985 183.7395 189.54401 195.3485 199.04401 204.326 210.13049 212.7715 218.0535 223.858 227.5535"
         y="103.968"
         id="tspan400">dernæst osten, inden man har frit valg i ingrediens-</tspan><tspan
         x="0 3.6954999 9.5 17.945499 23.75 29.554501 32.195499 37.477501 42.759499 48.563999"
         y="116.964"
         id="tspan402">tombolaen.</tspan></text>

    <text

       id="text436"><tspan
         x="0 6.7639999 12.4735 16.073999 18.886 23.541 26.087 29.6875 33.810501 39.52 44.707001 48.307499 51.119499 56.306499 59.907001 62.719002 68.428497 72.028999 77.216003 81.871002 87.057999 90.658501 93.470497 98.657501 102.258 105.07 111.834 117.021 121.676 124.222 129.9315 132.7435 137.3985 139.9445 143.545 147.668 153.3775 158.5645 161.29289 163.8389 166.65089 171.30589 173.8519 177.45239 181.57539 187.2849 192.47189 196.0724 198.8844 204.5939 209.7809 213.47639"
         y="0"
         id="tspan414">Hos Fischer er drevet af David Fischer. Fischer har </tspan><tspan
         x="0 5.1869998 8.7875004 14.497 19.684 22.23 27.939501 33.126499 36.727001 39.539001 45.248501 50.435501 53.247501 57.030399 59.576401 66.340401 69.940903 75.650398 80.837402 86.546898 91.733902 94.545898 97.091904 99.9039 105.0909 110.2779 113.8784 116.4244 120.0249 122.8369 128.5464 134.25591 137.0679 142.2549 145.85539 148.6674 154.37691 159.5639 163.1644 165.97639 171.16341 174.7639 177.5759 183.2854 188.4724 191.28439 196.9939 202.7034 211.05389 214.74844"
         y="12.996"
         id="tspan416">arbejdet på L’Arpège i Paris og et par år på Roms </tspan><tspan
         x="0 5.1869998 10.8965 16.0835 19.684 23.2845 28.4715 31.283501 34.883999 38.484501 43.671501 47.271999 50.872501 53.418499 58.605499 62.206001 67.915497 73.102501 78.811996 83.999001 86.810997 95.683998 98.230003 102.353 108.0625 113.2495 115.7955 118.3415 124.051 127.1195 130.72 135.907 139.50751 143.108 148.295 154.0045 157.605 162.79201 168.5015 172.10201 174.64799 177.46001 182.11501 187.302 190.114 195.30099 200.48801 204.0885 209.798 215.50751 218.0535 223.24049 225.8815"
         y="25.992001"
         id="tspan418">eneste trestjernede Michelin-restaurant, La Pergola, </tspan><tspan
         x="0 2.546 8.2554998 13.965 19.152 24.8615 27.6735 33.382999 38.57 44.279499 47.091499 52.2785 57.987999 63.697498 68.884499 74.594002 79.780998 82.593002 89.357002 95.066498 98.667 101.479 106.134 108.68 112.2805 116.4035 122.113 127.3 130.9005 133.71249 139.422 144.60899 147.42101 153.49339 156.0394 160.1624 163.76289 169.4724 173.07291 175.8849 181.59441 187.30389 190.9044 196.61391 201.8009 205.4014 208.21339 213.40041 215.9464 221.13341 226.8429 230.44341 233.08345"
         y="38.987999"
         id="tspan420">inden han åbnede Hos Fischer på Victor Borges Plads. </tspan><tspan
         x="0 2.641 5.5479999 10.83 16.112 21.393999 26.676001 29.583 35.387501 38.0285 43.310501 46.217499 52.021999 57.304001 63.108501 66.015503 71.297501 73.938499 76.579498 79.486504 82.127502 87.931999 90.838997 96.643501 101.9255 104.8325 110.637 113.278 118.028 122.778 128.06 130.701 133.608 140.467 145.74899 151.5535 154.46049 158.15601 163.96049 172.40601 177.688 181.3835 185.07899 190.36099 195.64301 198.55 203.832 207.5275"
         y="51.984001"
         id="tspan422">I 2019 gik han all in på pizza. Den romerske af </tspan><tspan
         x="0 3.6954999 6.3365002 11.6185 17.423 21.1185 26.400499 32.205002 35.112 39.862 42.769001 48.573502 53.855499 59.66 62.567001 71.012497 76.294502 82.098999 85.005997 90.288002 96.092499 98.999496 104.804 107.445 111.1405 114.836 120.118 123.8135 128.56351 134.368 140.1725 143.0795 148.884 154.68851 157.5955 162.8775 168.68201 173.964 177.6595 182.9415 188.746 194.55051 199.8325 202.7395 208.54401 214.3485 220.153 225.9575 228.5985"
         y="64.980003"
         id="tspan424">slagsen – den med en ultratynd og knasende bund. </tspan><tspan
         x="0 6.8590002 12.141 15.8365 18.7435 24.025499 29.307501 35.112 38.019001 40.66 43.567001 49.371498 54.6535 60.458 63.365002 69.169502 72.864998 78.147003 83.9515 86.858498 90.554001 98.999496 104.2815 110.086 115.368 119.0635 121.7045 124.6115 129.89349 133.589 136.496 141.246 143.88699 147.5825 151.80051 157.605 162.88699 166.5825 169.4895 175.29401 180.576 184.2715 187.1785 189.8195 195.62399 201.4285 206.71049 209.61749 215.422 220.70399"
         y="77.975998"
         id="tspan426">Det kan i dén grad smages, at Fischer har inde på </tspan><tspan
         x="0 3.6954999 8.4455004 14.25 17.945499 23.227501 29.032 34.313999 40.1185 42.759499 45.6665 50.948502 54.644001 57.550999 62.833 68.637497 73.919502 76.560501 81.842499 84.483498 87.390503 95.835999 101.118 106.9225 109.8295 113.525 119.3295 124.0795 129.3615 133.05701 141.5025 147.30701 152.589 155.496 159.1915 164.4735 169.2235 174.50549 178.201 183.483 187.1785 190.08549 195.89 201.6945 205.39 208.297 214.1015 219.3835 222.02451 227.3065"
         y="90.972"
         id="tspan428">rygraden, at enkle, men suveræne råvarer gør hele </tspan><tspan
         x="0 3.6954999 9.5 13.1955 16.891001 22.173 27.455 30.096001 32.737 38.019001 43.823502"
         y="103.968"
         id="tspan430">forskellen.</tspan><tspan
         x="0 6.8590002 12.6635 16.358999 19.266001 24.016001 26.657 30.352501 34.570499 40.375 45.657001 49.352501 52.259499 58.063999 63.346001 67.041496 69.948502 75.230499 77.871498 81.567001 84.208 90.012497 92.919502 98.2015 101.365 106.647 109.554 113.2495 119.054 122.7495 126.445 131.72701 137.009 139.64999 142.291 144.93201 150.7365 156.01849 158.92551 164.73 167.371 172.121 176.871 182.153 187.435 191.13049 194.03751 199.842 205.12399"
         y="116.964"
         id="tspan432">Hos Fischer har altid 4-6 forskellige pizzaer på </tspan><tspan
         x="0 8.4455004 13.7275 19.532 25.3365 30.6185 36.423 39.063999 41.971001 47.775501 53.580002 56.487 62.2915 67.573502 70.480499 75.762497 81.567001 85.262497 88.958 94.239998 97.935501 100.8425 106.1245 111.4065 116.6885 119.3295 122.493 125.4 130.68201 133.5054"
         y="129.96001"
         id="tspan434">menuen, og de koster 100,- kr.</tspan></text>

       id="text462"><tspan
         x="0 4.579 8.2744999 10.9155 16.719999 22.002001 26.219999 31.502001 34.409 37.049999 39.957001 46.816002 52.620499 56.316002 62.120499 66.870499 72.152496 75.848 79.543503 82.4505 87.732498 91.428001 94.334999 96.975998 102.7805 106.476 111.758 115.4535 118.3605 126.806 129.44701 135.2515 141.056 144.7515 150.03349 152.94051 158.2225 164.02699 169.8315 172.73849 178.02049 181.716 184.623 190.42751 195.7095 199.92751 202.5685 208.373 213.655 217.35049 222.63251 226.328"
         y="0"
         id="tspan446">Tribeca i Nordvest er intet mindre end et decideret </tspan><tspan
         x="0 5.8045001 8.4455004 13.1955 17.945499 23.227501 26.391001 29.298 35.102501 40.907001 43.813999 49.6185 52.259499 55.423 58.063999 63.346001 69.150497 74.955002 78.650497 83.932503 87.627998 93.432503 97.127998 99.768997 105.5735 114.019 116.66 119.567 125.3715 130.6535 134.349 137.256 143.0605 148.3425 152.03799 154.94501 158.6405 164.44501 169.72701 173.94501 176.586 181.868 184.509 187.14999 190.8455 196.1275 199.823 205.105 208.80051 211.7075 215.403 218.04401 223.8485"
         y="12.996"
         id="tspan448">pizza- og øl-laboratorium, der har specialiseret sig </tspan><tspan
         x="0 2.641 5.5479999 9.2434998 11.8845 16.102501 18.7435 21.384501 24.025499 29.307501 35.112 38.807499 44.0895 46.996498 50.692001 54.387501 59.669498 65.473999 71.278503 76.028503 81.833 85.528503 91.333 93.973999 98.723999 103.474 108.756 111.397 114.304 121.163 126.445 129.35201 135.15649 140.961 145.711 148.35201 153.634 156.27499 161.55701 165.2525 168.1595 173.4415 179.246 185.05051 188.746 192.4415 197.7235 203.528 207.2235 210.13049 215.935 220.685 225.967"
         y="25.992001"
         id="tspan450">i siciliansk stenovnspizza. De udvikler konstant nye </tspan><tspan
         x="0 3.6954999 12.141 17.423 23.227501 26.923 30.6185 35.900501 44.346001 52.7915 58.073502 63.877998 67.573502 76.018997 79.7145 85.518997 88.160004 93.9645 99.768997 105.051 107.8744 110.5154 113.4224 121.8679 127.1499 132.95441 135.8614 141.1434 143.78439 147.4799 150.1209 155.9254 158.8324 167.27789 172.55991 178.3644 181.27139 187.0759 192.35789 198.1624 200.80341 206.60789 212.4124 215.05341 218.7489 224.0309 229.3129"
         y="38.987999"
         id="tspan452">smagssammensætninger, men altid med økologiske </tspan><tspan
         x="0 3.6954999 8.9775 13.7275 19.009501 22.705 27.987 30.8104 33.451401 36.358398 40.937401 46.741901 55.187401 60.469398 64.164902 67.071899 72.876404 78.680901 81.587898 90.033401 95.837898 100.5879 105.3379 110.6199 114.3154 119.5974 122.2384 124.8794 130.16141 133.06841 138.3504 142.0459 144.9529 148.64841 153.9304 157.6259 161.3214 166.60339 169.51041 172.1514 177.9559 183.76041 187.4559 192.7379 198.5424 201.1834 206.46539 212.2699 215.96539 221.24741 224.9429"
         y="51.984001"
         id="tspan454">råvarer. Tomat og mozzarella er faste ingredienser </tspan><tspan
         x="0 5.8045001 11.0865 13.9935 22.438999 27.721001 33.525501 39.330002 44.612 50.4165 54.112 57.807499 63.0895 66.785004 69.426003 72.333 80.778503 86.060501 91.864998 94.772003 100.5765 105.8585 109.554 112.461 117.743 121.4385 124.3455 130.14999 135.9545 139.64999 144.93201 147.839 153.121 155.76199 159.4575 162.0985 167.903 170.81 176.6145 179.25549 184.53751 190.342 194.03751 196.9445 200.64 203.28101 205.922"
         y="64.980003"
         id="tspan456">på menukortet, men der er også altid plads til </tspan><tspan
         x="0 5.2820001 10.564 14.2595 20.063999 23.759501 26.400499 30.096001 35.377998 40.66 43.567001 46.208 52.012501 57.817001 61.512501 66.794502 72.598999 75.239998 80.522003 86.3265 90.022003 95.304001 98.999496 101.9065 105.602 111.4065 119.852 122.759 125.4 131.2045 137.009 142.81351 145.4545 150.7365 153.64349 156.80701 160.5025 164.198 172.64349 176.339 181.621 184.26199 187.16901 190.8645 199.31 205.1145 208.81 214.6145 219.8965 223.592"
         y="77.975998"
         id="tspan458">eksotiske ingredienser som ’nduja (stærk, smørbar </tspan><tspan
         x="0 2.641 6.3365002 11.6185 14.2595 16.900499 22.182501 27.987 31.682501 36.9645 39.871498 45.675999 51.480499 54.121498 57.817001 63.098999 66.262497 68.903503 71.810501 77.614998 82.897003 88.7015 93.983498 99.788002 103.4835 107.179 109.82 112.727 118.009 121.7045 127.509 132.791 136.4865 142.291 147.573 151.26849 154.17551 159.98 165.7845 168.6915 173.9735 177.66901 181.3645 184.00549 187.701 192.983 198.78751 204.0695 208.28751 211.983 217.265 225.71049 230.99249"
         y="90.972"
         id="tspan460">italiensk pølse), gedeost, asparges og artiskokcreme.</tspan></text>

    <text

       id="text78"><tspan
         x="0 4.75 10.5545 19 24.804501 30.608999 35.890999 41.695499 47.5 52.782001 55.688999 59.384499 64.666496 68.362 71.002998 76.285004 82.0895 87.893997 91.5895 94.496498 102.942 108.224 114.0285 116.9355 122.2175 128.022 130.929 134.6245 138.32001 144.1245 147.82001 150.72701 153.368 159.1725 164.97701 170.259 176.06351 181.868 187.6725 191.368 195.06351"
         y="0"
         id="tspan52">Spændende feriehus med en stor indendørs </tspan><tspan
         x="0 3.6954999 11.609 14.25 22.695499 31.141001 33.782001 39.586498 45.390999 51.195499 57 62.804501 65.445503 68.352501 74.156998 79.961502 82.8685 88.150497 93.955002 96.862 102.6665 107.9485 111.644 116.926 122.7305 128.0125 133.817 139.62151 144.9035 147.8105 153.61501 159.41949 163.11501 165.756 171.5605 175.256 178.16299 183.9675 189.772 192.679 198.48351 203.23351 208.5155 212.211"
         y="12.996"
         id="tspan54">swimmingpool og en betagende udsigt ud over </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 27.977501 30.884501 36.688999 42.4935 45.400501 50.682499 53.323502 55.9645 59.66 63.355499 68.637497 72.333 78.137497 83.419502 86.3265 91.0765 96.358498 102.163 105.07 111.05595 116.33795 120.03345 123.72895 129.01096 132.70645 138.51096 143.79295 148.54295 153.82495 157.52045 160.16145 163.06845 169.92744 175.73195 179.42744 184.70946 188.40495 192.10045 195.00745 200.81195 206.09395 208.73495 211.37595 214.01695 219.82146 225.10345"
         y="25.992001"
         id="tspan56">heden og klitterne ved Vesterhavet. Husets dejlige </tspan><tspan
         x="0 2.641 8.4455004 14.25 17.945499 23.227501 26.923 32.727501 35.3685 41.173 46.977501 49.884499 58.330002 63.612 69.416496 72.323502 78.127998 80.768997 83.410004 88.692001 91.333 94.239998 100.0445 105.849 111.6535 116.9355 119.8425 123.538 129.3425 134.0925 139.3745 144.1245 152.57001 156.2655 161.5475 164.18851 167.884 173.166 175.98845 178.62946 181.53645 187.34094 192.09094 197.89545 203.69995 208.98195 211.62296 214.26395 220.06845 223.76395"
         y="38.987999"
         id="tspan58">indretning med bl.a. gode soveværelser, hyggeligt </tspan><tspan
         x="0 5.2820001 11.0865 16.3685 21.650499 26.932501 32.737 35.900501 41.182499 43.823502 47.519001 53.323502 61.769001 64.676003 73.121498 78.403503 84.208 87.114998 92.919502 96.614998 105.0605 110.865 116.6695 121.9515 127.756 132.506 138.3105 140.95151 143.85851 147.554 153.35851 158.6405 164.44501 169.72701 175.53149 178.43851 184.243 190.0475 192.9545 196.64999 201.93201 207.7365 213.541 218.823"
         y="51.984001"
         id="tspan60">køkken-alrum med brændeovn, spabad og sauna </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.695499 27.977501 31.673 34.580002 38.275501 43.557499 52.002998 60.448502 65.730499 71.535004 74.442001 80.246498 88.692001 91.598999 96.880997 102.6855 105.5925 111.397 117.2015 123.006 125.913 131.7175 137.522 140.429 145.711 149.40649 153.10201 155.743 161.02499 166.8295 172.634 177.916 183.7205 189.52499 194.80701 197.714 201.4095 206.6915 210.38699 213.028 218.31 220.951"
         y="64.980003"
         id="tspan62">danner rammen om en god og afslappende ferie. </tspan><tspan
         x="0 4.75 8.4455004 12.141 17.423 23.227501 29.032 34.313999 40.1185 43.025501 45.6665 48.307499 54.112 59.9165 65.198502 68.893997 71.801003 77.083 82.887497 88.692001 91.598999 96.880997 102.163 107.445 110.352 118.7975 121.7045 127.509 133.31351 137.009 140.7045 145.9865 148.6275 151.5345 157.339 162.621 166.3165 172.121 177.92551 180.8325 186.63699 195.0825 198.778 204.06 209.8645 215.1465 218.842 221.483"
         y="77.975998"
         id="tspan64">Stranden ligger kun 400 m borte. Besøg området, </tspan><tspan
         x="0 5.8045001 8.4455004 11.0865 16.3685 19.009501 21.9165 28.775499 33.525501 36.1665 41.971001 47.252998 50.16 54.91 60.192001 65.996498 71.801003 77.083 79.989998 88.435501 93.717499 99.522003 102.429 106.1245 108.7655 112.461 117.743 123.025 126.7205 129.3615 135.166 140.448 145.198 151.0025 153.9095 162.355 167.63699 173.4415 176.3485 184.79401 190.5985 193.2395 195.88049 201.685 207.4895 212.7715 218.576"
         y="90.972"
         id="tspan66">bl.a. Hvide Sande med fiskerihavn med mulighed </tspan><tspan
         x="0 3.6954999 9.5 13.1955 16.102501 20.852501 26.134501 31.938999 37.7435 41.438999 46.721001 49.362 52.002998 54.91 58.605499 64.410004 68.105499 71.801003 74.442001 80.246498 86.051003 88.958 94.762497 100.567 103.474 107.1695 109.8105 113.506 118.788 124.07 127.7655 130.40649 133.0475 135.9545 141.2365 143.8775 146.51849 151.80051 155.496 158.403 164.2075 170.01199 173.7075 178.9895 181.8965 188.75549 194.03751 198.78751 204.592"
         y="103.968"
         id="tspan68">for vandski, surfing og fiskeri, eller Bork Havn </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 27.721001 33.525501 36.432499 42.237 46.987 52.7915 58.596001 63.877998 66.518997 69.160004 74.9645 77.871498 81.567001 84.208 90.012497 93.708 99.512497 105.317 110.599 115.349 121.1535 124.0605 129.86501 135.66949 138.57651 143.85851 147.554 150.461 154.15649 159.961 168.40649 174.211 180.0155 185.2975 191.10201 196.90649 202.18851"
         y="116.964"
         id="tspan70">med en hyggelig fjordhavn og et spændende </tspan><tspan
         x="0 4.75 7.3909998 12.673 15.314 21.1185 26.923 32.205002 40.650501 46.455002 50.150501 55.432499 61.237 69.682503 72.323502 75.230499 82.0895 87.371498 91.067001 93.973999 99.255997 102.9515 105.8585 111.663 116.945 120.6405 123.5475 129.35201 134.634 138.3295 142.02499 147.30701 152.589 156.2845 161.5665 164.4735 168.16901 173.451 177.1465 179.78751 185.0695 190.87399 196.6785 200.37399 203.015 205.922 211.7265 216.4765 222.28101 225.9765"
         y="129.96001"
         id="tspan72">vikingemuseum. Her er det perfekte feriehus, hvor </tspan><tspan
         x="0 5.8045001 11.609 15.3045 21.108999 25.858999 29.554501 32.461498 38.265999 44.070499 47.765999 53.048 55.955002 61.237 64.932503 67.8395 72.5895 77.871498 80.512497 85.794502 91.598999 100.0445 105.849 111.131 113.772 116.679 119.32 122.227 127.509 131.2045 134.1115 137.80701 143.089 148.89349 154.698 158.39349 161.30051 167.105 175.55051 179.246 184.528 190.3325 195.6145 198.5215 202.217 208.0215 211.717 214.62399 220.4285 225.71049 231.515"
         y="142.95599"
         id="tspan74">husdyr også er velkomne, i et skønt område for den </tspan><tspan
         x="0 5.8045001 11.0865 14.782 18.477501 23.759501 29.0415 32.737 38.019001 40.925999 44.621498 49.9035 53.598999 56.240002 61.521999 64.163002"
         y="155.952"
         id="tspan76">perfekte ferie. </tspan></text>

         y="0"
         id="tspan88">På en dejlig lynggrund ligger dette store, </tspan><tspan
         x="0 3.6954999 9.5 13.1955 16.891001 19.532 24.813999 30.096001 35.377998 38.285 41.980499 47.262501 50.958 53.598999 58.881001 64.685501 70.489998 74.185501 76.8265 79.733498 86.592499 91.874496 95.57 98.476997 103.759 107.4545 110.3615 113.0025 118.807 124.6115 128.30701 133.589 137.2845 140.98 146.26199 149.9575 152.8645 161.31 166.592 172.3965 175.3035 177.9445 180.8515 186.1335 188.77451 192.47 195.377 199.07249 201.7135 205.409 210.69099"
         y="12.996"
         id="tspan90">rustikke feriehus. Det er indrettet med i alt fire </tspan><tspan
         x="0 3.6954999 9.5 14.25 19.532 24.282 32.727501 36.423 41.705002 44.346001 48.0415 53.323502 56.1469 58.787899 61.694901 67.499397 73.303902 76.210899 82.015404 87.297401 90.992897 96.797401 102.6019 108.4064 113.1564 118.4384 122.1339 125.0409 130.32291 134.0184 136.9254 142.7299 148.0119 151.7074 154.6144 159.89639 165.7009 168.60789 174.4124 179.6944 188.13989 191.8354 194.7424 203.1879 208.46989 214.2744"
         y="25.992001"
         id="tspan92">soveværelser, og derudover er der en hems med </tspan><tspan
         x="0 3.6954999 9.5 12.407 16.102501 21.907 26.657 31.938999 37.7435 40.384499 45.6665 51.471001 55.1665 60.448502 63.2719 65.912903 68.819901 75.678902 80.960899 86.765404 89.672401 95.476898 100.2269 106.0314 111.8359 117.1179 119.7589 122.3999 128.20441 133.4864 136.3934 142.19791 148.0024 153.8069 159.6114 162.2524 168.0569 171.7524 175.44791 179.1434 184.94791 190.2299 193.1369 195.77789 198.4189 204.2234 210.02789 215.30991 219.0054"
         y="38.987999"
         id="tspan94">to sovepladser. Den hyggelige opholdsstue ligger </tspan><tspan
         x="0 2.641 5.5479999 11.3525 13.9935 17.688999 22.971001 28.253 31.9485 37.230499 40.137501 43.833 49.637501 53.333 59.137501 61.7785 67.583 73.387497 78.669502 81.310501 85.005997 90.288002 93.195 101.6405 106.9225 112.727 115.634 120.916 126.7205 132.0025 137.2845 142.5665 148.371 151.278 157.0825 162.88699 165.79401 169.4895 175.29401 177.935 181.63049 186.91251 190.608 194.3035 200.108 205.39 208.03101"
         y="51.984001"
         id="tspan96">i direkte forbindelse med køkken og spisestue. </tspan><tspan
         x="0 4.75 8.4455004 14.25 19.532 25.3365 28.2435 34.048 39.330002 43.025501 45.932499 49.627998 53.323502 59.127998 62.823502 68.105499 71.012497 76.817001 82.098999 87.903503 93.708 97.403503 102.6855 111.131 116.413 121.163 123.804 129.60851 135.41299 141.2175 146.4995 149.32291 151.9639 154.8709 160.6754 165.4254 171.2299 174.9254 178.6209 182.31641 187.5984 190.5054 196.30991 201.5919 205.2874 208.1944 213.47639 217.17191"
         y="64.980003"
         id="tspan98">Stuen har store panoramavinduer, hvorfra der er </tspan><tspan
         x="0 5.8045001 11.609 15.3045 17.945499 23.75 27.445499 30.352501 34.048 36.688999 39.330002 42.237 48.0415 53.323502 59.127998 62.035 65.730499 74.176003 79.980499 85.262497 90.544502 95.8265 98.733498 104.538 109.82 113.5155 119.32 122.1434 124.7844 127.6914 133.4959 139.3004 142.2074 144.8484 147.7554 151.4509 156.73289 160.42841 163.3354 167.0309 172.8354 176.5309 182.3354 187.6174 196.0629 204.50841 209.79041 212.4314 216.12691 221.40891 227.21339"
         y="77.975998"
         id="tspan100">udsigt til den smukke natur, og I får fornemmelsen </tspan><tspan
         x="0 5.2820001 8.9775 11.6185 14.5255 19.807501 23.503 26.41 32.2145 37.496498 41.192001 46.996498 50.692001 55.973999 61.7785 64.685501 69.967499 73.663002 76.57 79.210999 85.015503 90.297501 95.579498 100.8615 104.557 107.464 110.105 115.9095 121.714 126.996 132.80051 136.496 142.30051 145.1239 147.76489 150.67191 153.3129 156.21989 162.0244 167.3064 173.1109 176.0179 181.2999 187.1044 192.3864 195.2934 200.57539 206.3799 212.1844 217.4664"
         y="90.972"
         id="tspan102">af, at naturen er lukket indenfor. I den ene ende </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 17.688999 23.4935 27.188999 32.471001 36.1665 39.073502 44.355499 48.050999 50.958 56.762501 62.044498 65.739998 68.647003 72.342499 80.255997 82.897003 91.342499 99.788002 102.429 108.2335 114.038 119.8425 125.647 131.45151 134.0925 136.73351 139.6405 143.336 149.1405 154.4225 160.22701 165.509 171.31351 174.2205 180.02499 185.8295 188.7365 192.43201 197.714 203.51849 209.323 214.605 217.246"
         y="103.968"
         id="tspan104">af huset er der swimmingpool, spabad og sauna. </tspan><tspan
         x="0 5.2820001 10.564 13.471 17.1665 22.4485 26.143999 29.8395 35.121498 38.817001 42.512501 47.794498 53.598999 56.506001 61.787998 67.07 72.874496 75.781502 84.226997 89.509003 95.313499 98.220497 101.916 104.557 110.3615 116.166 121.448 124.355 130.1595 133.855 139.6595 143.355 147.05051 150.746 155.496 159.1915 162.88699 168.16901 171.8645 174.7715 180.576 186.38049 189.28751 195.092 199.842 205.6465 210.9285"
         y="116.964"
         id="tspan106">På terrassen kan man sidde uforstyrret og nyde </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 19.798 23.4935 27.188999 29.83 33.525501 38.807499 44.0895 46.996498 49.637501 55.442001 59.137501 62.833 65.473999 68.380997 75.239998 80.522003 84.217499 87.124496 92.406502 96.101997 99.009003 101.65 106.932 112.214 117.496 120.403 123.044 128.326 134.13049 139.935 143.63049 146.53751 150.233 152.87399 155.515 158.422 163.172 168.45399 174.2585 180.063 182.70399 187.98599 193.7905 199.595 202.23599"
         y="129.96001"
         id="tspan108">den friske luft. Der er ikke langt til vandland, </tspan><tspan
         x="0 3.6954999 8.9775 14.782 20.5865 23.227501 26.923 32.727501 38.009499 43.813999 49.096001 52.7915 55.698502 61.502998 67.307503 70.2145 76.018997 81.823502 84.4645 88.160004 93.9645 99.246498 105.051 110.333 112.974 115.881 122.74 128.022 131.7175 134.6245 139.90649 143.60201 146.509 151.791 157.5955 163.39999 166.30701 170.0025 172.64349 175.2845 177.92551 183.2075 189.01199 192.7075 195.6145 200.8965 204.592"
         y="142.95599"
         id="tspan110">tennisbaner og golfbane. Det er kun tilladt at </tspan><tspan
         x="0 8.4455004 13.7275 19.532 25.3365 29.032 31.673 37.477501 43.282001 48.563999 51.471001 56.752998 60.448502 63.355499 69.160004 74.9645 78.660004 84.4645 89.2145 92.037903"
         y="155.952"
         id="tspan112">medbringe ét husdyr.</tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,249.9774)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text144"><tspan
         x="0 6.8590002 12.6635 15.3045 20.5865 24.282 27.188999 32.9935 38.798 42.4935 45.400501 53.846001 59.127998 64.932503 67.8395 73.643997 79.448502 85.252998 87.893997 90.801003 96.605499 101.3555 107.16 112.9645 118.2465 121.942 124.849 127.49 130.397 135.679 141.48351 144.3905 148.086 150.72701 156.53149 160.22701 162.868 165.77499 174.2205 180.02499 185.8295 191.1115 194.80701 200.6115 205.89349 208.80051 212.496 216.1915 218.8325 221.4735"
         y="0"
         id="tspan124">Unikt hus med pool bygget i en flot, moderne stil </tspan><tspan
         x="0 5.8045001 11.609 14.516 17.157 22.9615 28.766001 34.048 39.852501 45.657001 48.298 54.102501 59.384499 65.189003 70.9935 76.275497 79.182503 84.4645 87.105499 90.801003 93.442001 96.348999 102.1535 106.9035 112.1855 117.99 120.897 123.538 126.445 130.1405 135.4225 140.7045 143.3455 146.2525 152.05701 155.7525 161.55701 167.3615 172.64349 175.55051 181.355 186.63699 189.54401 193.2395 198.5215 202.217 204.858 210.14 215.9445 218.58549"
         y="12.996"
         id="tspan126">og indeholdende alt, hvad I skal bruge på ferien. </tspan><tspan
         x="0 5.2820001 11.0865 16.891001 19.532 23.227501 29.032 37.477501 45.923 51.205002 54.900501 57.807499 61.502998 67.307503 75.752998 84.198502 89.480499 93.176003 96.083 101.8875 107.692 111.3875 116.6695 119.5765 124.8585 130.66299 133.57001 137.2655 140.961 146.7655 150.461 153.368 156.009 161.81351 167.618 172.89999 178.7045 184.509 190.31351 194.009 197.7045 200.6115 204.30701 210.1115 215.39349 218.0345"
         y="25.992001"
         id="tspan128">Poolrummet rummer også en stor indendørs spa. </tspan><tspan
         x="0 6.8590002 9.5 12.141 17.423 20.33 25.08 33.525501 37.221001 42.502998 45.144001 48.8395 54.121498 57.817001 60.723999 66.005997 69.7015 72.608498 81.054001 86.335999 92.140503 97.422501 101.118 104.025 107.7205 113.525 121.9705 130.416 135.698 138.339 140.98 146.7845 152.0665 154.9735 160.778 166.5825 169.4895 175.29401 180.576 184.2715 187.1785 192.983 198.78751 201.4285 205.12399"
         y="38.987999"
         id="tspan130">Alle værelser er meget rummelige og har højt </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 14.5255 20.33 24.025499 27.721001 33.002998 36.698502 39.3395 42.246498 48.050999 53.855499 56.762501 62.567001 67.848999 73.653503 79.458 84.739998 87.647003 93.4515 98.733498 104.538 109.82 114.57 123.0155 126.711 131.993 134.634 138.3295 143.6115 147.30701 150.214 155.496 159.1915 162.0985 167.903 172.653 177.935 180.576 183.483 190.342 195.62399 199.3195"
         y="51.984001"
         id="tspan132">til loftet, og begge badeværelser er nye. Det </tspan><tspan
         x="0 4.75 10.032 12.673 15.314 21.1185 26.923 30.6185 35.900501 39.596001 43.2915 48.573502 54.377998 59.66 62.567001 67.848999 73.653503 78.935501 84.217499 89.499496 95.304001 98.467499 103.7495 106.3905 110.086 115.8905 124.336 127.243 135.68851 140.9705 146.77499 149.68201 155.4865 159.18201 167.6275 173.43201 179.2365 184.51849 190.323 195.073 200.8775"
         y="64.980003"
         id="tspan134">velindrettede køkken-alrum med brændeovn </tspan><tspan
         x="0 2.641 8.4455004 14.25 19.532 25.3365 31.141001 33.782001 39.586498 44.8685 48.563999 51.471001 56.752998 59.394001 63.0895 65.996498 68.637497 71.544502 77.348999 82.630997 86.3265 92.130997 97.413002 100.32 106.1245 110.8745 113.5155 119.32 124.602 129.35201 134.634 138.3295 143.6115 146.43491 149.0759 151.98289 158.8419 164.64639 168.3419 174.14639 178.89639 182.5919 185.4989 190.7809 194.47639"
         y="77.975998"
         id="tspan136">indeholder alt i hårde hvidevarer. Husdyr er </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.6185 16.900499 22.705 26.400499 29.0415 31.9485 39.3395 47.785 51.480499 56.762501 62.567001 67.848999 71.544502 74.4515 79.733498 83.429001 86.335999 91.617996 96.900002 102.7045 108.509 112.2045 115.1115 118.807 124.6115 128.30701 131.214 137.01849 142.823 148.6275 153.9095 156.8165 160.51199 166.3165 170.01199 173.7075 182.153 187.9575 190.5985 193.2395 199.04401 204.8485 210.13049 215.935 221.217 224.91251"
         y="90.972"
         id="tspan138">tilladt. Området er kendt for gode surfmuligheder </tspan><tspan
         x="0 2.641 5.5479999 11.3525 13.9935 19.798 25.602501 30.884501 36.688999 42.4935 45.134499 50.938999 56.7435 59.650501 64.400497 67.041496 72.846001 76.541496 82.346001 85.252998 91.057503 96.862 99.768997 105.5735 110.8555 116.66 119.567 122.208 124.849 127.49 130.131 135.41299 138.054 140.961 146.7655 151.5155 157.32001 163.1245 168.40649 171.0475 173.68851 179.493 184.77499 187.68201 193.4865 198.76849 203.51849 209.323 211.964 214.871 217.51199"
         y="103.968"
         id="tspan140">i Ringkøbing Fjord og den lille, hyggelige havn. I </tspan><tspan
         x="0 5.8045001 14.25 17.945499 23.75 29.032 34.836498 40.1185 45.923 48.830002 51.471001 54.112 59.9165 65.721001 71.002998 74.698502 77.605499 83.410004 88.692001 92.387497 95.294502 100.5765 106.381 109.288 115.0925 120.897 124.5925 130.397 135.679 140.429 145.711 151.5155 154.15649 156.7975 162.60201 165.509 169.2045 172.89999 176.5955 181.8775 187.68201 193.4865 196.1275"
         y="116.964"
         id="tspan142">nærheden ligger der en børnevenlig strand. </tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.8727,707.5237)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text180"><tspan
         x="0 6.8590002 12.141 14.782 17.423 20.063999 25.8685 29.563999 32.471001 36.1665 41.448502 45.144001 47.785 53.067001 58.871498 64.676003 68.371498 71.278503 79.723999 85.005997 90.810501 93.717499 97.413002 103.2175 108.4995 111.4065 115.102 120.384 128.8295 132.52499 135.43201 139.1275 144.4095 150.214 156.01849 161.30051 164.2075 170.01199 175.8165 178.7235 184.00549 189.81 192.717 198.5215 204.326 206.967 212.24899"
         y="0"
         id="tspan156">Dejligt feriehus med spa samt sauna og en unik </tspan><tspan
         x="0 5.8045001 11.0865 13.7275 16.3685 22.173 27.977501 33.259499 39.063999 44.8685 50.150501 55.955002 58.862 63.612 68.893997 74.698502 77.605499 84.4645 89.746498 95.551003 101.3555 106.6375 109.5445 114.2945 117.99 121.6855 126.9675 132.772 138.57651 141.2175 144.1245 150.98351 156.2655 159.961 162.868 168.14999 171.8455 174.7525 180.55701 185.839 188.746 197.1915 202.4735 208.278 214.0825 219.3645"
         y="12.996"
         id="tspan158">beliggenhed ved Henne Strand. Det er på mange </tspan><tspan
         x="0 8.4455004 13.7275 19.532 24.813999 28.509501 31.4165 36.698502 40.394001 43.300999 49.105499 52.800999 58.083 63.365002 67.060501 69.7015 73.397003 78.679001 81.585999 87.390503 93.195 96.890503 99.531502 102.4385 108.243 112.993 118.7975 122.493 125.4 131.2045 136.4865 140.18201 143.089 148.371 152.0665 154.9735 158.66901 167.1145 172.91901 178.201 181.8965 184.8035 190.608 195.89 198.797 204.07899 206.72 209.36099 214.64301"
         y="25.992001"
         id="tspan160">måder et praktisk hus, hvor der er tænkt på alle </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 25.8685 31.150499 34.846001 37.487 43.2915 49.096001 54.377998 57.200451 59.84145 62.748451 67.680847 70.321854 72.962852 75.86985 81.674347 87.478851 91.174347 96.978851 102.26085 108.06535 113.34735 116.25435 121.53635 125.23185 128.13885 133.94334 139.22536 142.92085 145.82785 151.63235 154.27335 156.91435 162.19635 164.83736 167.74435 173.02635 178.83086 181.73785 187.54234 193.34685 199.15135 201.79234"
         y="38.987999"
         id="tspan162">generationer. Til børnene er der bl.a. en god, </tspan><tspan
         x="0 2.641 5.2820001 7.9229999 10.564 15.846 18.753 24.557501 29.8395 38.285 41.980499 44.621498 47.5285 51.223999 57.0285 65.473999 68.380997 73.663002 78.945 84.749496 87.656502 93.460999 97.156502 102.961 108.7655 114.0475 117.743 120.65 124.3455 126.9865 129.6275 132.5345 135.17551 140.4575 146.26199 151.54401 157.3485 163.153 165.79401 171.076 173.717 176.62399 183.483 189.28751 192.983 198.78751 203.53751 207.233"
         y="51.984001"
         id="tspan164">lille hems, som kan bruges til legehule. Husdyr </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 15.58 18.221001 20.862 23.503 28.785 34.5895 38.285 40.925999 43.833 50.692001 56.496498 60.192001 65.473999 69.169502 72.864998 75.772003 78.413002 84.217499 90.022003 95.304001 101.1085 106.913 112.7175 116.413 120.1085 123.0155 128.82001 134.6245 140.429 143.07001 148.35201 152.0475 157.85201 163.134 165.77499 168.416 174.2205 180.02499 182.93201 188.214 193.496 199.30051 202.2075 205.903 211.185 214.88049"
         y="64.980003"
         id="tspan166">er tilladt. Husets indendørs poolafdeling kan ses </tspan><tspan
         x="0 3.6954999 7.3909998 12.673 15.58 19.275499 22.971001 28.775499 34.057499 39.862 42.502998 45.41 49.105499 54.387501 57.294498 59.935501 62.842499 68.124496 73.406502 79.210999 82.117996 87.922501 93.726997 96.367996 102.1725 107.4545 110.3615 116.166 118.807 124.089 126.996 135.4415 140.7235 146.528 149.435 155.2395 161.04401 164.7395 170.54401 175.826 181.63049 186.91251 189.5535 192.46049 199.3195 204.6015 210.40601 216.21049 221.49249"
         y="77.975998"
         id="tspan168">fra stuen, så I kan holde øje med børnene. Henne </tspan><tspan
         x="0 5.8045001 11.0865 14.782 17.688999 22.971001 26.6665 29.5735 34.855499 38.550999 41.458 48.317001 53.598999 59.4035 67.848999 73.130997 76.8265 82.108498 85.804001 88.710999 94.515503 99.797501 105.602 109.2975 112.993 118.275 121.182 126.9865 132.26849 135.964 141.76849 145.464 151.26849 159.714 163.4095 168.6915 174.496 179.778 182.60139 185.2424 188.1494 193.9539 199.75841"
         y="90.972"
         id="tspan170">har et af Danmarks bedste naturområder, og </tspan><tspan
         x="0 5.8045001 11.0865 14.782 20.5865 26.391001 32.195499 36.945499 42.227501 45.923 48.830002 54.112 57.807499 60.7145 66.518997 71.801003 75.496498 78.403503 84.208 89.489998 95.294502 100.5765 103.4835 109.288 115.0925 117.7335 121.429 124.07 126.977 130.6725 133.31351 139.118 144.9225 147.56351 153.368 159.1725 162.0795 167.884 173.68851 176.5955 181.3455 186.6275 192.43201 198.2365 201.93201 207.214 210.9095 216.714 220.4095 225.6915"
         y="103.968"
         id="tspan172">derudover er der både golf, ridning og vandreture </tspan><tspan
         x="0 5.8045001 14.25 17.945499 21.641001 26.923 32.727501 35.634499 41.438999 44.080002 47.775501 53.057499 58.3395 62.035 67.317001 70.223999 76.028503 81.833 87.114998 92.919502 95.8265 99.522003 105.3265 109.022 111.929 117.7335 123.538 127.2335 132.5155 138.32001 140.961 143.868 149.6725 154.9545 160.759 164.4545 168.14999 173.9545 182.39999 185.30701 190.589 194.2845 197.1915 204.05051 209.3325 215.13699 220.9415 226.2235"
         y="116.964"
         id="tspan174">næsten direkte uden for døren. Centrum af Henne </tspan><tspan

         y="38.987999"
         id="tspan196">og opholdsstuen. Stuen har klinker med løse </tspan><tspan

         id="tspan198">tæpper, og alle soverum har trægulv. Der er 5 </tspan><tspan

         y="64.980003"
         id="tspan200">dejlige soverum samt to flotte badeværelser. Den </tspan><tspan

         y="77.975998"
         id="tspan202">velmøblerede stue har brændeovn, som spreder </tspan><tspan

         y="90.972"
         id="tspan204">hygge og varme. Fra stuen kan I holde øje med </tspan><tspan

         y="103.968"

         y="129.96001"
         id="tspan210">sauna og spabad. Til huset hører også to dejlige </tspan><tspan

         id="tspan212">terrasser, begge med halvmure til at skabe læ. </tspan><tspan

         y="38.987999"
         id="tspan246">flere gode soveværelser – i det ene er der opsat et </tspan><tspan
         x="-39.795502 -34.5135 -30.818001 -25.0135 -19.731501 -17.0905 -11.286 -7.5904999 -4.427 -1.52 4.2845001 10.089 12.996 17.214001 23.018499 31.464001 37.268501 43.073002 46.768501 52.050499 55.745998 61.550499 67.355003 71.050499 76.855003 79.496002 82.403 91.371002 96.653 102.4575 105.3645 113.81 119.092 121.999 127.8035 133.08549 137.83549 143.11749 146.02451 151.82899 157.6335 161.32899 167.1335 171.8835 175.57899 178.48599 181.127"
         y="51.984001"
         id="tspan248">arbejds- og computerbord. Man må have husdyr i </tspan><tspan

         y="64.980003"
         id="tspan250">huset. Nyd området på de anlagte stier på gåben, til </tspan><tspan

         y="77.975998"
         id="tspan252">hest og på cykel. Hvis I har heldet med jer, kan I se </tspan><tspan

         y="0"
         id="tspan50">I naturskønne omgivelser nord for Søndervig ligger </tspan><tspan
         x="0 5.8045001 11.0865 14.782 18.477501 23.759501 26.6665 32.471001 36.1665 41.448502 47.252998 50.948502 54.644001 60.448502 63.0895 68.893997 74.176003 77.083 80.778503 84.473999 88.169502 93.4515 97.147003 105.5925 110.8745 114.57 119.852 122.759 131.2045 137.009 140.7045 144.39999 148.0955 153.3775 159.18201 162.8775 168.68201 174.4865 178.18201 180.823 183.73 187.42551 193.23 201.67551 204.5825 209.8645 213.56"
         y="12.996"
         id="tspan52">dette pragtfulde stråtækte murstenshus, som er </tspan><tspan
         x="0 4.75 10.032 12.673 17.955 23.759501 29.563999 34.846001 38.5415 41.448502 45.144001 47.785 50.425999 53.333 57.0285 59.669498 64.9515 68.647003 73.929001 76.835999 80.531502 85.813499 94.259003 96.900002 99.541 102.182 107.464 110.2874 112.9284 115.8354 122.1719 127.9764 136.42191 140.1174 145.92191 149.6174 153.3129 158.59489 164.3994 167.3064 172.58839 176.28391 179.1909 181.83189 184.73891 188.4344 196.8799 200.57539 205.85741 208.4984 213.7804 217.47591 221.1714 226.4534"
         y="25.992001"
         id="tspan54">velegnet til flere familier. Komforten er i særklasse </tspan><tspan
         x="0 2.641 5.5479999 11.3525 16.634501 20.33 24.025499 29.307501 32.2145 35.91 41.192001 44.887501 47.5285 52.810501 58.615002 64.419502 68.114998 70.755997 73.663002 79.467499 85.272003 88.179001 93.460999 96.101997 98.742996 104.025 106.932 112.7365 118.541 122.2365 127.5185 131.214 134.9095 137.8165 143.621 149.42551 152.0665 156.8165 162.0985 165.00549 170.28751 173.983 176.89 182.6945 187.9765 190.61749 195.89951 201.70399 205.39951 208.3065 216.752 222.034 227.8385"
         y="38.987999"
         id="tspan56">i dette feriehus, og alle husets gulve er belagt med </tspan><tspan
         x="0 5.2820001 7.9229999 10.564 16.3685 21.650499 26.932501 29.755899 32.3969 35.303902 37.944901 40.851898 46.656399 52.460899 58.2654 60.906399 66.1884 69.883904 75.6884 80.970398 83.611397 86.252403 92.0569 97.861397 103.1434 108.9479 111.8549 117.1369 122.4189 128.2234 131.1304 136.93491 142.7394 145.64639 149.3419 154.6239 160.42841 165.7104 168.6174 174.42191 177.0629 182.8674 185.7744 191.0564 196.8609 199.7679 205.5724 211.37691 216.65891 221.9409 227.2229 230.9184 234.61391"
         y="51.984001"
         id="tspan58">klinker. I poolafdelingen kan du tage dig en dukkert </tspan><tspan
         x="0 5.8045001 11.609 14.516 18.2115 23.4935 31.938999 34.580002 39.862 42.769001 48.573502 53.323502 56.230499 61.512501 67.317001 72.598999 76.294502 82.098999 84.739998 87.647003 90.288002 93.195 96.890503 102.695 107.977 113.7815 119.0635 124.868 130.14999 133.8455 137.541 140.448 145.198 150.48 154.17551 162.621 167.903 170.54401 173.451 179.25549 185.06 190.8645 193.50549 198.78751 204.592 210.3965 215.6785"
         y="64.980003"
         id="tspan60">og samle ny energi i spabadets varme, boblende </tspan><tspan
         x="0 4.75 10.032 15.8365 21.641001 24.282 27.188999 34.048 39.330002 45.134499 48.0415 53.323502 58.605499 61.246498 66.528503 71.810501 77.092499 79.999496"
         y="77.975998"
         id="tspan62">vand. Den 10.500 m</tspan></text>

         y="25.992001"
         id="tspan74">med soveplads til to personer, oplagt til familiens </tspan><tspan

         y="38.987999"
         id="tspan76">børn og unge. Søndervig er en hyggelig lille by </tspan><tspan

         y="51.984001"
         id="tspan78">med kunsthåndværkere, dagligvareforretninger, </tspan><tspan

         y="64.980003"

       id="text114"><tspan
         x="0 6.8590002 12.141 14.782 17.423 20.063999 25.8685 29.563999 32.471001 36.1665 41.448502 45.144001 47.785 53.067001 58.871498 64.676003 68.371498 71.278503 79.723999 85.005997 90.810501 93.717499 97.413002 101.1085 106.913 110.6085 113.5155 119.32 125.1245 130.929 133.57001 138.85201 142.5475 148.35201 153.634 156.27499 158.916 164.7205 170.52499 173.166 176.073 179.76849 185.573 190.855 196.6595 201.9415 207.746 210.653 214.3485 219.63049 228.076 231.7715"
         y="0"
         id="tspan92">Dejligt feriehus med stor poolafdeling, spabad samt </tspan><tspan
         x="0 3.6954999 8.9775 14.782 20.5865 25.8685 28.509501 31.4165 38.275501 44.080002 47.775501 53.057499 56.752998 59.66 64.942001 68.637497 71.544502 77.348999 81.044502 86.3265 91.608498 95.304001 97.945 101.6405 106.9225 109.8295 112.4705 118.275 124.0795 127.775 133.05701 136.7525 140.448 145.73 149.42551 152.3325 160.778 166.06 171.8645 174.7715 180.0535 183.74899 186.65601 190.3515 194.047 199.8515 203.547 207.24249 212.52451"
         y="12.996"
         id="tspan94">sauna. Huset er praktisk indrettet med et større </tspan><tspan
         x="0 5.2820001 11.0865 16.3685 21.650499 26.932501 32.737 35.900501 41.182499 43.823502 47.519001 53.323502 61.769001 64.676003 73.121498 78.403503 84.208 87.114998 92.397003 95.038002 97.679001 103.4835 108.7655 114.0475 119.852 125.6565 128.2975 133.0475 135.9545 141.759 147.56351 150.4705 156.27499 162.0795 164.7205 169.4705 174.2205 179.5025 183.198 191.64349 196.92551 199.8325 203.528 208.81 217.25549 220.951"
         y="25.992001"
         id="tspan96">køkken-alrum med klinkegulv og gulvvarme samt </tspan><tspan
         x="0 5.8045001 11.609 17.4135 22.695499 28.5 34.304501 37.211498 40.907001 43.548 46.188999 49.096001 54.377998 60.182499 63.0895 66.785004 70.480499 76.285004 79.980499 82.887497 86.583 91.864998 95.560501 99.255997 104.538 108.2335 111.929 117.211 120.118 128.56351 133.8455 139.64999 142.55701 147.839 151.5345 154.4415 160.246 164.996 170.278 173.9735 179.778 188.2235 193.50549 198.78751 204.0695 207.765"
         y="38.987999"
         id="tspan98">udgang til en stor terrasse med et overdækket </tspan><tspan
         x="0 5.8045001 9.5 12.141 14.782 17.423 23.227501 31.673 35.3685 40.650501 46.455002 51.737 54.377998 57.285 62.567001 67.848999 70.755997 76.560501 80.255997 86.060501 91.864998 97.669502 102.9515 108.756 111.663 115.3585 117.9995 123.804 129.60851 134.8905 138.586 141.493 146.77499 152.5795 155.4865 159.18201 162.8775 168.68201 172.3775 175.2845 177.92551 183.2075 189.01199 194.29401 200.0985 205.903 209.5985 215.403"
         y="51.984001"
         id="tspan100">grillområde. På grunden findes en stor legeborg </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.382 26.077499 31.882 35.577499 39.272999 41.914001 47.195999 53.0005 58.282501 64.086998 69.369003 72.219002 75.914497 81.196503 89.641998 93.337502 96.1875 101.992 107.7965 113.0785 118.883 124.6875 130.492 134.1875 137.883 140.733 146.53751 152.342 156.03751 161.842 165.53751 170.8195 176.62399 182.4285 185.0695 188.765 191.40601 194.256 201.11501 206.91949 210.61501 216.41949 221.16949 224.86501 227.715 232.99699 236.6925"
         y="64.980003"
         id="tspan102">med rutsjebane samt udendørs bordtennis. Husdyr er </tspan><tspan
         x="0 4.75 10.032 12.673 17.955 23.759501 32.205002 38.009499 43.2915 45.932499 48.8395 53.5895 58.3395 63.0895 65.996498 71.278503 79.723999 82.630997 86.3265 90.022003 95.304001 98.210999 104.0155 109.82 113.5155 118.7975 122.493 125.4 128.041 130.68201 136.4865 142.291 147.573 151.26849 154.17551 161.5665 167.371 171.0665 174.76199 180.5665 186.371 189.278 196.13699 201.9415 204.5825 208.278 214.0825 219.3645 225.16901 230.451 233.092"
         y="77.975998"
         id="tspan104">velkomne. Syv km fra huset ligger Outrup Golfbane, </tspan><tspan
         x="0 5.8045001 11.609 14.516 20.320499 25.602501 29.298 32.205002 37.487 41.182499 44.0895 48.307499 53.057499 58.3395 63.621498 66.262497 69.958 73.653503 76.294502 79.2015 82.897003 85.538002 88.179001 91.085999 96.367996 102.1725 105.0795 110.3615 114.057 116.964 121.714 126.996 130.6915 134.38699 139.66901 144.41901 148.1145 151.81 157.092 162.8965 166.592 169.49899 175.3035 180.58549 186.39 190.08549 193.78101 199.063"
         y="90.972"
         id="tspan106">og der er cykelsti til én af vestkystens bedste </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 25.8685 29.563999 33.259499 38.5415 44.346001 50.150501 55.432499 58.3395 63.0895 68.371498 74.176003 77.083 83.942001 88.692001 91.333 97.137497 102.942 105.583 110.865 114.5605 120.365 123.272 125.913 128.82001 134.6245 137.2655 142.5475 147.2975 152.5795 158.384 164.18851 166.8295 169.7365 177.1275 182.93201 186.6275 191.9095 197.1915 200.88699 203.79401 206.435 209.342 214.62399 220.4285"
         y="103.968"
         id="tspan108">badestrande ved Hvidbjerg i Blåvand. Ønsker I en </tspan><tspan
         x="0 2.641 5.2820001 11.0865 14.782 17.688999 26.134501 31.4165 35.112 40.394001 43.300999 46.996498 52.800999 55.442001 58.083 63.887501 66.794502 70.489998 74.185501 77.880997 83.163002 88.967499 94.772003 97.413002 100.32 105.602 109.2975 112.2045 118.009 123.8135 127.509 131.2045 139.64999 145.4545 149.14999 154.43201 157.339 162.089 165.7845 169.48 174.76199 180.5665 186.371 189.278 195.0825 200.88699 203.528 208.81 214.6145 218.31 220.951 223.858 229.66251 235.467"
         y="116.964"
         id="tspan110">lidt mere rolig strand, er Børsmose Strand oplagt, og </tspan><tspan

         y="129.96001"

         y="0"
         id="tspan124">I Holmslands Klits pragtfulde natur ligger dette </tspan><tspan

         y="12.996"
         id="tspan126">smagfuldt indrettede feriehus tæt ved havet og med </tspan><tspan
         x="0 5.2820001 11.0865 13.9935 17.688999 22.971001 28.775499 34.580002 37.487 43.2915 49.096001 52.7915 55.432499 61.237 64.932503 67.8395 71.535004 75.230499 80.512497 83.419502 89.223999 92.919502 98.723999 104.5285 110.333 115.615 121.4195 124.0605 126.9675 132.2495 138.054 143.85851 146.4995 150.19501 155.9995 164.44501 172.8905 178.1725 181.868 184.77499 187.416 193.2205 199.02499 204.8295 209.5795 215.384 220.666 224.3615"
         y="25.992001"
         id="tspan128">en skøn udsigt fra grunden. Poolrummet indbyder </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 17.1665 22.4485 26.143999 28.785 33.535 36.175999 39.871498 45.1535 48.848999 51.756001 57.560501 63.365002 66.272003 68.913002 74.195 79.999496 82.906502 85.547501 88.454498 94.259003 99.541 105.3455 108.2525 113.5345 118.8165 121.7235"

       id="text158"><tspan

         y="0"
         id="tspan138">store swimmingpool, </tspan><tspan
         x="-136.952 -131.14751 -125.343 -122.436 -116.6315 -111.3495 -107.654 -104.747 -99.464996 -95.769501 -92.862503 -87.057999 -81.253502 -77.557999 -72.276001 -69.369003 -65.6735 -59.868999 -54.587002 -48.782501 -43.5005 -37.695999 -34.789001 -28.984501 -23.18 -20.273001 -16.577499 -11.2955 -5.4910002 0.31349999 5.5955 8.2364998 11.1435 18.002501 23.806999 29.089001 34.893501 40.698002 46.502499 50.198002 53.893501 56.800499 62.0825 67.364502 73.168999"
         y="12.996"
         id="tspan140">og der er også spabad og sauna. Udendørs kan </tspan><tspan
         x="-136.952 -134.311 -131.40401 -125.5995 -120.8495 -115.045 -109.2405 -103.9585 -101.0515 -95.247002 -89.964996 -87.057999 -83.362503 -78.080498 -74.385002 -70.689499 -65.407501 -61.712002 -58.016499 -52.734501 -46.93 -44.289001 -41.382 -37.686501 -35.045502 -29.7635 -23.959 -18.154499 -12.8725 -9.9654999 -4.6834998 -0.98799998 1.919 4.5599999 7.467 10.108 12.749 18.553499 24.358 29.639999 33.335499 37.030998 42.835499 45.476501 50.758499 56.563 61.845001 64.751999 70.556503 76.361"
         y="25.992001"
         id="tspan142">I hygge på terrassen, slappe af i liggestolene og </tspan><tspan
         x="-136.952 -131.14751 -127.452 -124.811 -122.17 -119.529 -114.247 -111.34 -108.699 -100.2535 -94.971497 -91.276001 -85.994003 -83.086998 -74.641502 -69.359497 -66.718498 -63.022999 -60.382 -54.577499 -49.295502 -46.472099 -43.8311 -40.924099 -34.065102 -28.260599 -24.5651 -18.760599 -14.0106 -10.3151 -7.4081001 -2.1261001 1.5694 4.4763999 8.1718998 10.8129 13.4539 16.0949 21.3769 27.1814 30.8769 33.517899 36.4249 43.283901 49.088402 52.783901 58.065899 61.761398 64.668404 67.309402 69.950401 75.754898 81.559402 86.8414 90.536903"
         y="38.987999"
         id="tspan144">grille lækre måltider. Husdyr er tilladt. Huset ligger </tspan><tspan
         x="-136.952 -134.311 -131.40401 -125.0675 -122.4265 -117.1445 -111.34 -105.5355 -99.731003 -96.823997 -88.378502 -83.096497 -80.455498 -77.814499 -72.532501 -64.086998 -61.18 -55.3755 -50.093498 -47.186501 -43.491001 -37.686501 -34.779499 -29.497499 -25.802 -22.106501 -18.410999 -13.129 -7.8470001 -4.1515002 -1.5105 3.2395 8.5214996 11.4285 17.233 21.983 27.264999 30.960501 33.8675 40.726501 45.476501 48.1175 53.922001 59.203999 62.111 66.861 72.142998 77.947502 83.751999 89.033997"
         y="51.984001"
         id="tspan146">i Klegod mellem de to attraktive byer Hvide Sande </tspan><tspan
         x="-136.952 -131.14751 -125.343 -122.436 -117.686 -111.8815 -106.077 -100.2725 -94.990501 -91.294998 -86.544998 -83.903999 -78.099503 -75.458504 -72.551498 -69.9105 -67.003502 -63.307999 -58.026001 -55.384998 -50.634998 -45.353001 -42.445999 -36.109501 -33.468498 -28.186501 -22.382 -16.577499 -10.773 -7.8660002 -4.1704998 -1.5295 4.2750001 10.0795 15.3615 19.056999 21.964001 24.605 27.246 30.153 35.9575 41.762001 47.566502 52.316502 57.598499 61.293999 64.200996 72.6465 77.928497 83.733002 89.537498 94.819504"
         y="64.980003"
         id="tspan148">og Søndervig. I selve Klegod finder I, udover mange </tspan><tspan
         x="-136.952 -131.14751 -125.343 -119.5385 -114.2565 -111.3495 -106.5995 -101.3175 -95.513 -89.708504 -86.013 -80.731003 -77.567497 -74.6605 -68.856003 -63.051498 -60.144501 -55.926498 -51.176498 -45.894501 -40.612499 -37.9715 -34.276001 -30.5805 -27.939501 -22.657499 -19.834101 -17.1931 -14.2861 -9.0040998 -3.1996 -0.29260001 5.5118999 10.2619 16.066401 21.870899 27.152901 29.7939 32.434898 38.239399 41.1464 44.8419 47.482899 51.178398 56.4604 61.742401 65.437897 71.242401 74.149399 79.953903 85.7584"
         y="77.975998"
         id="tspan150">gode vandre- og cykelstier, en hyggelig fiskesø og </tspan><tspan
         x="-136.952 -132.55255 -127.80255 -121.99805 -116.19355 -111.44355 -108.80255 -102.99805 -100.09105 -95.341049 -90.591049 -87.767647 -85.126648 -82.21965 -76.415154 -71.665154 -65.860649 -62.16515 -58.46965 -54.774151 -49.492149 -46.585152 -43.944149 -41.037151 -35.232651 -29.950649 -26.25515 -23.34815 -17.54365 -12.26165 -6.45715 -3.5501499 0.14534999 8.5908499 14.39535 19.677349 24.959351 30.24135 33.936852 37.632351 42.914349 45.82135 51.625851 57.430351 61.125851 63.76685 69.57135 73.266853 76.173851 79.869347 82.510353 85.151352"
         y="90.972"
         id="tspan152">Lyngvig Fyr, hvorfra I har den smukkeste udsigt til </tspan><tspan
         x="-136.952 -131.14751 -125.8655 -120.061 -114.779 -111.872 -106.0675 -100.7855 -96.0355 -93.128502 -87.323997 -81.519501 -78.612503 -74.917 -72.276001 -66.471497 -62.776001 -56.9715 -54.330502 -51.4235 -48.782501 -42.978001 -37.695999 -35.055 -29.2505 -23.445999 -18.164 -14.4685 -9.1864996 -5.4910002 -2.5840001 0.057 2.964 5.605 10.887 13.528 18.809999 24.6145 27.5215 32.803501 36.499001 39.405998 42.047001 44.688 50.4925 55.774502 58.415501 63.697498 69.501999 74.783997 78.4795 81.386497 85.082001 88.777496 91.418503"
         y="103.968"
         id="tspan154">både hav og fjord. Inkluderet i lejen er ligeledes fri </tspan><tspan
         x="-136.952 -133.2565 -130.61549 -126.92 -121.638 -116.356 -112.6605 -107.3785 -103.683 -100.776 -98.135002 -95.227997 -89.945999 -84.141502 -81.234497 -75.43 -70.148003 -67.507004 -64.599998 -59.318001 -55.622501 -52.7155 -45.856499 -40.051998 -35.301998 -30.02 -26.324499 -23.4175 -16.5585"
         y="116.964"
         id="tspan156">fiskeret i en del af Hover Å.</tspan></text>

    <text
