       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text194"><tspan
         x="0 6.8590002 12.141 15.8365 19.532 24.813999 27.721001 31.4165 36.698502 40.394001 43.035 48.317001 54.121498 59.925999 63.621498 66.528503 74.973999 80.255997 86.060501 88.967499 91.608498 97.413002 103.2175 108.4995 114.304 120.1085 125.913 129.60851 133.304 136.211 139.90649 147.82001 150.461 158.90649 167.35201 169.993 175.7975 181.60201 187.40649 193.211 199.0155 201.65649 204.56351 207.2045 209.8455 215.64999 221.4545 226.7365 230.43201"
         y="0"
         id="tspan172">Dette feriehus med indendørs swimmingpool ligger </tspan><tspan
         x="0 5.8045001 11.0865 13.9935 19.275499 25.08 27.987 31.682501 35.377998 41.182499 44.877998 47.785 53.5895 58.871498 62.567001 68.371498 72.067001 77.871498 81.567001 87.371498 93.176003 98.980499 101.8875 107.692 111.3875 119.833 125.6375 129.33299 134.61501 140.41949 146.224 151.506 154.41299 160.2175 166.022 168.929 172.6245 175.2655 177.90649 180.81351 187.6725 192.4225 200.868 203.509 209.31351 215.118 220.39999"
         y="12.996"
         id="tspan174">på en stor naturgrund grænsende op til Nyminde </tspan><tspan
         x="0 6.3365002 8.9775 11.6185 15.314 21.1185 23.759501 29.0415 34.846001 38.5415 43.823502 49.627998 54.91 57.550999 60.458 65.390404 68.031403 70.672401 73.579399 79.383904 85.1884 88.883904 94.165901 97.861397 100.7684 106.5729 112.3774 116.0729 121.3549 125.0504 127.9574 133.2394 139.0439 141.9509 147.7554 153.0374 155.67841 158.3194 160.9604 166.76489 169.67191 173.3674 178.6494 182.34489 186.04041 191.3224 195.0179 198.71339 203.99541"
         y="25.992001"
         id="tspan176">Klitplantage. Til huset hører en dejlig terrasse </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 28.2435 32.9935 38.798 44.602501 49.884499 52.7915 58.596001 64.400497 67.307503 71.002998 76.285004 82.0895 87.893997 93.176003 98.458 102.1535 105.849 111.131 113.772 116.679 121.429 125.1245 130.929 136.211 142.0155 144.9225 150.2045 153.89999 156.80701 162.6115 167.3615 173.166 178.9705 184.2525 186.89349 189.5345 195.339 199.0345 201.9415 207.746 213.55051"
         y="38.987999"
         id="tspan178">med gynge og sandkasse. Stuen er hyggeligt og </tspan><tspan
         x="0 5.8045001 11.0865 14.782 18.477501 24.282 30.0865 32.727501 35.3685 41.173 44.8685 47.775501 50.4165 56.221001 62.025501 65.721001 71.002998 74.698502 78.393997 83.676003 87.371498 90.278503 96.083 101.8875 104.7945 110.599 115.881 119.5765 122.4835 128.28799 130.929 134.6245 139.90649 145.18851 148.884 154.166 157.073 162.8775 168.68201 174.4865 179.76849 185.573 191.3775 194.2845 197.98 200.621 203.26199"
         y="51.984001"
         id="tspan180">personligt indrettet og har direkte udgang til </tspan><tspan
         x="0 3.6954999 8.9775 12.673 16.3685 21.650499 25.346001 29.0415 34.323502 40.127998 43.035 46.730499 52.012501 60.458 64.153503 67.060501 72.342499 78.147003 81.054001 86.858498 90.554001 98.999496 104.804 110.6085 115.8905 121.695 126.445 132.2495 134.8905 137.7975 143.60201 148.884 152.5795 155.4865 158.1275 163.93201 169.7365 175.01849 178.714 181.621 187.42551 192.7075 195.6145 200.8965 206.701 209.342 211.983 217.78751 223.0695"
         y="64.980003"
         id="tspan182">terrassen samt en brændeovn, der luner på kølige </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 24.813999 27.721001 33.525501 38.807499 47.252998 55.698502 59.394001 64.676003 67.317001 70.223999 75.505997 79.2015 82.108498 87.913002 93.717499 97.413002 103.2175 107.9675 111.663 114.57 117.211 122.493 127.775 133.05701 135.964 141.246 144.9415 147.8485 151.54401 154.185 156.826 159.467 164.74899 170.5535 174.24899 176.89 179.797 187.188 192.99249 195.6335 200.9155 205.6655 208.57249 214.377 219.659 225.4635"
         y="77.975998"
         id="tspan184">dage. Bemærk, at husdyr ikke er tilladt. Oplev den </tspan><tspan
         x="0 3.6954999 12.141 17.945499 23.227501 28.509501 33.7915 36.698502 42.502998 47.785 51.480499 57.285 60.980499 63.887501 67.583 73.387497 79.192001 84.996498 88.692001 91.598999 97.403503 105.849 108.756 112.4515 115.0925 120.897 124.5925 130.397 135.679 141.48351 144.3905 150.19501 155.47701 158.384 162.0795 167.3615 173.166 178.9705 184.77499 190.05701 192.964 198.76849 204.05051 207.214 210.121 215.403 218.04401 220.685 225.967 229.66251"
         y="90.972"
         id="tspan186">smukke natur rundt om fjorden på skønne gå- eller </tspan><tspan
         x="0 4.2179999 8.9680004 14.25 19.532 22.173 25.8685 31.673 35.3685 40.650501 43.2915 46.198502 53.057499 57.807499 60.448502 64.143997 67.051003 69.692001 72.598999 77.880997 81.5765 84.483498 87.124496 91.874496 95.57 98.210999 104.0155 109.2975 112.2045 114.8455 119.5955 123.291 126.9865 130.68201 133.323 137.01849 142.30051 147.5825 151.278 156.56 159.201 162.108 167.39 172.672 178.4765 181.3835 184.02451 186.9315 190.627 195.909 201.7135 206.9955 209.9025 215.18449 220.989"
         y="103.968"
         id="tspan188">cykelture. Hvis I er ivrige lystfiskere, kan I tage en </tspan><tspan
         x="0 3.6954999 9.5 13.1955 16.102501 21.907 27.188999 30.096001 35.900501 41.182499 45.932499 51.2145 54.91 57.817001 66.262497 71.544502 77.348999 80.255997 83.9515 86.592499 90.288002 95.57 100.852 106.134 111.9385 115.634 119.3295 124.6115 127.4349 130.0759 132.98289 141.9509 147.7554 150.39639 153.0374 158.8419 164.64639 169.92841 175.73289 181.01489 184.7104 190.51489 195.79691 198.7039 203.9859 207.6814"
         y="116.964"
         id="tspan190">tur på havet med fiskekutter. Mulighederne er </tspan><tspan
         x="0 8.4455004 13.7275 19.532 25.3365 30.6185 33.525501 36.1665 39.073502 44.877998 50.16 55.9645 61.769001 67.051003 69.958 75.762497 81.044502 83.685501 86.3265 88.967499 94.772003 100.054 102.961 108.7655 114.0475 116.6885 119.5955 124.8775 128.573 131.48 138.339 143.621 149.42551 157.871 163.153 166.8485 172.13049"
         y="129.96001"
         id="tspan192">mange i denne dejlige del af Danmark.</tspan></text>

       xml:space="preserve"

    <text

       id="text230"><tspan
         x="0 5.2820001 8.9775 14.2595 20.063999 23.759501 27.455 33.259499 35.900501 41.705002 45.400501 48.307499 52.002998 57.285 60.980499 63.621498 68.903503 74.708 80.512497 84.208 87.114998 92.919502 98.2015 100.8425 103.4835 109.288 115.0925 120.3745 126.179 131.98351 137.2655 140.1725 142.81351 145.7205 150.4705 156.27499 161.55701 165.2525 168.948 172.64349 177.92551 180.8325 184.528 192.9735 198.25549 203.53751 208.8195 211.7265 217.53101 222.813"
         y="0"
         id="tspan204">Pragtfuldt feriehus beliggende i yderste række på </tspan><tspan
         x="0 5.2820001 11.0865 13.9935 19.275499 25.08 30.884501 36.1665 39.862 45.144001 48.8395 51.746498 57.0285 59.669498 62.310501 66.005997 71.810501 75.505997 81.310501 87.114998 92.919502 95.8265 104.272 109.554 115.3585 120.6405 124.336 127.243 130.93851 139.384 143.0795 145.9865 151.791 157.073 159.98 165.96594 171.24796 174.94345 178.63895 183.92094 187.61646 193.42094 198.70296 203.45296 208.73495 212.43045 215.07146"
         y="12.996"
         id="tspan206">en kuperet klitgrund meget tæt på Vesterhavet. </tspan><tspan
         x="0 6.8590002 12.141 17.945499 20.852501 24.548 27.188999 32.9935 36.688999 39.596001 45.400501 50.682499 55.9645 61.769001 65.4645 70.746498 74.442001 79.723999 85.528503 90.810501 93.717499 96.358498 102.163 107.9675 113.2495 119.054 124.8585 130.66299 134.35851 138.054 140.961 146.7655 152.57001 158.3745 161.0155 166.2975 169.993 175.7975 181.0795 183.7205 186.3615 192.166 197.9705 200.8775 206.68201 211.43201 217.2365 222.51849 226.214"
         y="25.992001"
         id="tspan208">Den fint dekorerede indendørs poolafdeling byder </tspan><tspan
         x="0 5.8045001 11.0865 13.9935 19.275499 25.08 27.987 31.682501 35.377998 41.182499 44.877998 47.785 51.480499 59.394001 62.035 70.480499 78.926003 81.567001 87.371498 93.176003 98.980499 104.785 110.5895 113.2305 115.8715 118.7785 122.474 128.2785 133.5605 139.36501 144.647 150.45151 153.35851 157.054 162.336 170.78149 174.47701 177.384 182.666 188.4705 194.27499 199.55701 205.3615 211.166 214.073 217.76849 220.4095 223.05051"
         y="38.987999"
         id="tspan210">på en stor swimmingpool, spabad samt adgang til </tspan><tspan
         x="0 3.6954999 8.9775 14.782 20.5865 25.8685 28.775499 34.580002 40.384499 43.2915 49.096001 54.377998 60.182499 65.4645 70.2145 78.660004 82.355499 87.637497 90.278503 93.973999 99.255997 101.897 104.804 111.663 117.4675 121.163 126.445 130.1405 133.0475 138.3295 142.02499 144.93201 150.7365 155.4865 161.291 167.0955 172.3775 175.01849 177.6595 183.464 187.1595 190.0665 192.7075 198.51199 204.3165 208.01199 213.29401 216.9895 220.685 225.967 229.66251"
         y="51.984001"
         id="tspan212">sauna og badeværelse. Huset er hyggeligt indrettet </tspan><tspan
         x="0 5.8045001 11.609 14.516 18.2115 20.852501 23.4935 26.134501 31.4165 37.221001 40.9165 43.823502 47.519001 53.323502 57.019001 59.925999 65.730499 71.535004 75.230499 81.035004 85.785004 88.608398 91.249397 94.156403 100.4929 106.2974 111.5794 116.8614 122.1434 127.9479 133.2299 136.9254 139.8324 142.4734 145.1144 150.9189 156.7234 162.0054 165.7009 168.60789 171.2489 174.1559 179.4379 185.2424 190.5244 196.3289"
         y="64.980003"
         id="tspan214">og tilladt for husdyr. Køkkenet ligger i åben </tspan><tspan
         x="0 3.6954999 9.5 13.1955 19 21.641001 27.445499 33.25 38.532001 41.173 44.8685 50.150501 53.057499 61.502998 66.785004 72.5895 75.496498 81.301003 86.583 92.387497 95.294502 98.989998 102.6855 108.49 112.1855 117.4675 120.3745 124.07 129.8745 132.5155 136.211 141.493 144.65649 147.56351 153.368 159.1725 162.0795 167.884 173.68851 179.493 185.2975 187.93851 193.743 197.43851 201.134 204.8295 210.634 215.916"
         y="77.975998"
         id="tspan216">forbindelse med den store spise- og opholdsstue </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 28.2435 31.938999 40.384499 46.188999 51.9935 57.275501 63.080002 67.830002 73.634499 76.275497 79.182503 84.4645 89.746498 92.653503 98.458 104.2625 107.958 113.24 116.9355 120.631 123.538 128.82001 132.5155 136.211 141.493 149.93851 153.634 162.0795 167.3615 173.166 178.448 181.355 185.05051 190.3325 194.028 197.7235 203.00549 206.701 210.3965 215.6785"
         y="90.972"
         id="tspan218">med brændeovn. På husets afskærmede terrasse </tspan><tspan
         x="0 5.2820001 10.564 16.3685 19.275499 21.9165 24.8235 28.518999 31.16 36.442001 42.246498 48.050999 53.333 56.240002 61.521999 65.217499 68.124496 76.57 81.851997 87.656502 90.563499 95.845497 101.65 104.557 109.839 115.6435 121.448 124.355 129.63699 134.91901 138.4454 142.1409 147.4229 150.0639 152.9709 161.4164 166.69839 172.5029 176.19839 179.10539 181.7464 184.6534 188.34891 190.9899 193.63091 199.43539 204.71741 208.4129 213.6949 219.4994 224.7814 228.4769"
         y="103.968"
         id="tspan220">kan I slappe af med en kop kaffe, mens I tilbereder </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 14.5255 22.971001 28.253 33.535 38.817001 42.512501 46.208 49.115002 57.560501 62.842499 65.483498 69.179001 71.82 77.624496 80.531502 88.976997 94.259003 100.0635 102.9705 108.775 114.057 116.964 122.7685 126.464 129.105 131.746 134.38699 139.66901 145.4735 148.1145 151.0215 157.88049 163.16251 166.858 169.765 175.047 178.74249 181.64951 187.45399 192.73599 198.01801 201.7135 205.409 209.10451 214.38651 220.19099 225.9955"
         y="116.964"
         id="tspan222">et lækkert måltid mad på grillen. Der er gåafstand </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 17.870449 23.152451 25.793449 31.075451 34.77095 38.46645 41.373451 47.177952 51.224949 53.865952 56.772949 62.57745 67.327454 73.13195 76.827454 79.734451 85.538948 90.820953 94.516449 97.423447 103.22795 105.86895 108.50995 113.79195 116.43295 119.33995 124.62195 128.31744 131.22446 136.50645 140.20195 143.10895 148.91345 154.71796 157.35895 161.05444 163.69545 168.97745 174.25945 180.06395 185.86845 191.15045 194.84595 197.48695 200.39395 206.19846 212.00294 214.90994 220.19196 223.88745"
         y="129.96001"
         id="tspan224">til Vejers by, hvor der bl.a. er et bolsjekogeri og et </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 25.8685 28.509501 31.150499 34.057499 39.3395 44.621498 47.5285 53.333 58.615002 64.419502 67.3265 72.608498 78.413002 83.695 86.601997 90.297501 92.938499 98.742996 104.025 106.932 112.214 115.9095 118.8165 124.80245 130.08446 132.72545 138.00745 141.70296 145.39845 148.30545 153.05545 156.75095 160.44646 165.72845 171.53294 177.33745 180.24445 185.52644 189.22195 192.12895 197.93346 200.57445 203.21545 208.49745 214.30196 217.99745 221.69295 226.97495 229.61595"
         y="142.95599"
         id="tspan226">bageri. På den ene side af Vejers Strand er bilkørsel </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.6185 16.900499 22.705 26.400499 29.0415 31.9485 40.394001 45.675999 51.480499 55.175999 58.083 63.887501 69.169502 74.973999 77.880997 83.163002 88.967499 94.772003 100.054 105.8585 108.7655 114.57 119.852 122.493 125.4 130.68201 134.3775 137.2845 143.089 145.73 148.371 152.0665 155.76199 158.403"
         y="155.952"
         id="tspan228">tilladt, mens den anden del er bilfri.</tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text266"><tspan
         x="0 6.8590002 12.141 17.945499 23.75 29.032 31.938999 35.634499 39.330002 43.025501 48.307499 52.002998 60.448502 65.730499 69.426003 74.708 77.614998 80.255997 86.060501 90.810501 93.4515 96.358498 102.163 106.913 112.7175 117.9995 121.695 124.602 130.40649 135.68851 138.5955 144.39999 149.68201 152.589 158.39349 164.198 167.89349 170.5345 178.98 184.26199 186.903 192.185"
         y="0"
         id="tspan240">Denne stråtækte idyl byder på de optimale </tspan><tspan
         x="0 8.4455004 14.25 16.891001 19.532 25.3365 31.141001 36.423 42.227501 47.509499 51.205002 54.112 57.807499 63.612 67.307503 70.2145 73.910004 79.192001 83.942001 89.223999 91.864998 94.772003 100.054 105.8585 108.7655 114.0475 117.743 121.4385 124.0795 129.3615 135.166 140.9705 146.2525 149.948 152.855 156.55051 162.355 170.80051 173.7075 178.9895 184.79401 187.701 192.983 198.265 201.96049 204.6015 209.3515"
         y="12.996"
         id="tspan242">muligheder for såvel en afslappet som en aktiv </tspan><tspan
         x="0 3.6954999 8.9775 12.673 15.314 20.596001 23.237 26.143999 30.893999 36.175999 39.871498 42.512501 47.794498 53.598999 59.4035 63.098999 68.380997 72.0765 74.983498 77.624496 80.265503 86.07 91.874496 97.156502 100.852 103.759 106.4 109.307 114.589 118.2845 121.1915 126.996 132.278 140.7235 149.16901 154.451 157.092 160.78751 163.6945 168.9765 171.61749 174.2585 177.95399 181.11749 184.02451 189.82899 195.6335"
         y="25.992001"
         id="tspan244">ferie. Feriehuset ligger i et gammelt klit- og </tspan><tspan
         x="0 5.8045001 8.4455004 13.7275 19.532 23.227501 28.509501 34.313999 39.596001 45.400501 53.846001 57.5415 62.823502 68.627998 73.910004 76.817001 85.262497 90.544502 96.348999 99.255997 104.538 108.2335 111.1405 114.836 117.477 123.2815 126.977 129.884 135.68851 140.43851 144.134 149.416 152.05701 154.698 158.745 161.386 164.293 169.575 175.3795 181.18401 186.466 192.27049 195.17751 200.4595 204.155"
         y="38.987999"
         id="tspan246">plantageområde med et rigt dyreliv. Egnen er </tspan><tspan
         x="0 5.8045001 11.0865 14.782 18.477501 23.759501 29.0415 32.737 35.644001 39.3395 41.980499 44.621498 47.5285 50.169498 55.4515 61.256001 67.060501 72.342499 75.249496 79.999496 85.281502 91.085999 96.890503 100.586 105.868 109.0315 111.6725 114.5795 117.2205 123.025 128.8295 134.1115 137.27499 140.18201 145.464 148.105 150.746 156.028 159.7235 162.63049 166.8485 171.5985 176.88049 182.16251 184.8035 188.49899 194.3035 197.99899 203.28101 206.188 211.99249 217.27451"
         y="51.984001"
         id="tspan248">perfekt til lange vandre-, løbe- eller cykelture på </tspan><tspan
         x="0 5.8045001 11.0865 13.9935 19.275499 22.971001 31.4165 39.862 43.557499 48.8395 54.121498 59.925999 65.208 68.114998 71.810501 75.505997 78.147003 83.429001 86.252403 88.893402 91.8004 97.604897 102.8869 106.5824 109.4894 115.2939 117.9349 123.2169 129.02139 134.8259 138.52139 141.42841 146.7104 152.51489 158.3194 163.60139 167.29691 170.2039 173.8994 179.7039 183.3994 188.6814 192.37691 195.28391 201.08839 206.8929 209.7999 213.49541 216.1364 218.7774"
         y="64.980003"
         id="tspan250">de afmærkede stier, der blandt andet fører ud til </tspan><tspan
         x="0 5.98595 11.26795 14.96345 18.658951 23.94095 27.63645 33.440948 38.72295 43.47295 48.754951 52.450451 55.09145 57.998451 64.857452 70.13945 73.834953 76.741951 79.38295 82.289948 84.930946 90.212952 95.494949 100.77695 103.68395 109.48845 113.18395 118.98845 124.79295 128.48845 131.39545 136.67744 139.31845 141.95946 147.24146 150.14845 155.43045 159.12595 167.57146 171.26695 174.96245 180.24445 183.93996 189.74445 195.02644 197.93346 203.73795 209.54245 214.82445 217.73145 220.37245"
         y="77.975998"
         id="tspan252">Vesterhavet. Har I ikke brugt alle kræfterne ude i </tspan><tspan
         x="0 5.8045001 11.0865 14.782 20.5865 24.282 29.563999 35.3685 38.009499 40.9165 46.198502 51.480499 57.285 60.192001 62.833 65.739998 69.435501 74.717499 80.522003 85.804001 88.710999 93.992996 99.797501 102.7045 106.4 111.682 115.3775 120.6595 123.5665 127.262 132.01199 137.8165 146.26199 154.7075 159.9895 163.685 169.4895 173.185 176.092 178.733 181.64 187.4445 192.7265 198.53101 201.438 205.1335 208.82899 214.6335 218.32899 223.61099"
         y="90.972"
         id="tspan254">naturen, kan I tage en rask svømmetur i den store </tspan><tspan
         x="0 2.641 8.4455004 14.25 19.532 25.3365 31.141001 36.945499 40.640999 44.336498 47.2435 50.938999 58.852501 61.4935 69.939003 78.384499 81.025497 86.830002 92.634499 98.439003 104.2435 110.048 112.689 115.33 118.237 125.096 130.37801 134.0735 136.9805 142.2625 145.95799 148.86501 154.66949 160.474 164.16949 169.45151 172.35851 177.6405 183.44501 186.35201 192.15649 197.961 201.65649 207.461 212.743 218.5475 224.35201 230.15649 232.7975 235.43851"
         y="103.968"
         id="tspan256">indendørs swimmingpool. Der er også en børnepool. </tspan><tspan
         x="0 6.8590002 12.6635 16.358999 21.641001 25.3365 28.2435 33.525501 37.221001 40.127998 48.573502 54.377998 60.182499 65.4645 69.160004 74.9645 80.246498 83.153503 85.794502 91.598999 97.403503 101.099 106.381 110.0765 113.772 119.054 122.7495 125.6565 131.461 137.2655 140.1725 144.9225 150.2045 152.8455 158.1275 163.93201 169.7365 175.01849 178.714 181.621 185.3165 187.9575 190.5985 193.50549 197.201 199.842 205.12399 208.8195 214.1015"
         y="116.964"
         id="tspan258">Huset er moderne indrettet og velegnet til flere </tspan><tspan
         x="0 3.6954999 8.9775 17.423 20.063999 22.705 25.346001 30.628 33.451401 36.0924 38.999401 44.281399 49.5634 52.470402 58.274899 63.5569 69.361397 72.268402 75.963898 79.659401 85.463898 89.159401 94.441399 97.348396 99.989403 105.7939 111.0759 116.3579 121.6399 127.4444 132.72639 135.63341 139.3289 144.6109 148.3064 152.00191 157.28391 160.9794 164.6749 169.95689 172.86391 178.1459 183.4279 189.23241 192.1394 194.7804 197.68739 202.96941 205.6104 209.30589 211.9469 217.7514"
         y="129.96001"
         id="tspan260">familier. På den store lukkede terrasse kan I altid </tspan><tspan
         x="0 3.6954999 6.3365002 12.141 17.945499 23.227501 26.134501 28.775499 37.221001 39.862 42.769001 48.573502 53.855499 57.550999 60.458 63.098999 66.005997 70.755997 73.397003 76.038002 78.945 84.749496 89.499496 95.304001 100.586 103.493 107.1885 112.993 115.634 120.916 126.7205 130.416 133.323 138.073 143.355 147.05051 155.496 160.778 163.685 167.38049 171.076 174.7715 180.0535 182.6945 187.9765 190.7999 193.4409 196.3479 203.20689 209.0114 212.70689 218.5114 223.2614 226.95689"
         y="142.95599"
         id="tspan262">finde læ, når I vil nyde solens varme stråler. Husdyr </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 15.58 18.221001 20.862 23.503 28.785 34.5895 38.285"
         y="155.952"
         id="tspan264">er tilladt.</tspan></text>

    <text

       id="text140"><tspan
         x="0 5.8729 11.6774 15.3729 20.6549 24.350401 27.257401 30.9529 36.757401 40.4529 46.257401 51.539398 57.343899 60.2509 63.9464 69.228401 75.032898 80.314903 84.010399 86.917397 89.558403 94.840401 98.535896 101.4429 109.8884 115.1704 120.9749 123.8819 129.6864 134.9684 137.8754 143.15739 148.9619 151.8689 157.15089 160.05791 163.7534 166.39439 174.8399 180.1219 183.8174 187.51289 190.41991 196.2244 200.9744 206.7789 212.5834 217.8654 220.50639 223.1474 228.9519"
         y="0"
         id="tspan120">Vores turbåd tager jer med på en 2 timers hyggelig </tspan><tspan
         x="0 5.2820001 8.9775 12.673 17.955 23.759501 27.455 33.259499 36.955002 39.862 45.6665 50.948502 53.855499 58.605499 61.246498 69.692001 73.387497 76.028503 81.833 85.528503 91.333 96.614998 102.4195 105.0605 107.9675 114.8265 119.5765 125.381 128.28799 134.0925 139.3745 143.07001 145.97701 151.78149 157.06351 160.759 166.041 171.8455 177.1275 182.93201 188.7365 194.01849 196.92551 199.5665 204.8485 210.653 216.4575 220.153 225.435 230.717 236.5215"
         y="12.996"
         id="tspan122">aftentur på Limfjorden. Nyd det betagende landskab </tspan><tspan
         x="0 5.8045001 14.25 19.532 23.227501 25.8685 31.673 37.477501 40.384499 45.134499 50.4165 53.057499 55.698502 58.3395 64.143997 69.948502 73.643997 79.448502 85.252998 91.057503 96.862 100.5575 106.362 111.644 117.4485 120.3555 126.16 131.96449 134.87151 140.67599 145.95799 149.6535 152.5605 156.256 158.897 164.70151 168.397 172.0925 177.3745 180.28149 186.086 194.53149 198.22701 203.509 209.31351 214.5955 217.5025 222.2525 227.5345 233.339"
         y="25.992001"
         id="tspan124">omkring Sallingsundbroen og det flotte område ved </tspan><tspan
         x="0 4.75 10.032 15.8365 18.477501 24.282 30.0865 32.9935 38.97945 44.261452 46.902451 49.543449 54.825451 57.732449 61.427952 66.709953 70.405449 73.312447 77.00795 80.703453 85.985451 88.892448 92.587952 98.392448 102.08795 104.72895 110.53345 115.81545 121.61995 124.26095"
         y="38.987999"
         id="tspan126">Legind Vejle set fra søsiden. </tspan><tspan
         x="0 8.9680004 14.25 20.054501 25.858999 29.554501 32.195499 38 43.804501 46.711498 51.9935 56.7435 60.438999 63.080002 65.987 71.791496 74.432503 80.237 83.143997 88.426003 94.230499 99.512497 105.317 108.224 116.6695 121.9515 127.756 133.03799 138.8425 142.53799 146.58501 149.226 152.133 159.524 162.16499 164.806 167.713 172.463 177.745 183.5495 189.354 192.261 198.06551 203.87 206.77699 211.52699 214.168 219.9725"
         y="51.984001"
         id="tspan128">Medbring evt. din egen madkurv. Øl, vand og vin </tspan><tspan
         x="0 3.6954999 8.9775 14.2595 16.900499 19.807501 25.0895 30.893999 36.698502 41.980499 45.675999 48.583 54.387501 62.833 68.637497 74.442001 78.137497 83.942001 86.583"
         y="64.980003"
         id="tspan130">skal købes ombord. </tspan><tspan
         x="0 6.8590002 15.3045 19 22.695499 27.977501 31.673 37.477501 42.759499 45.400501 48.307499 54.112 59.394001 63.0895 65.996498 69.692001 73.387497 76.028503 81.833 87.114998 90.810501 93.717499 99.522003 104.804 107.711 112.461 117.743 123.5475 126.4545 131.2045 136.4865 139.1275 141.76849 144.4095 150.214 156.01849 159.714 165.51849 171.323 177.1275 180.0345 184.7845 193.23 196.92551 202.73 208.01199 213.29401 216.9895 222.79401 225.435"
         y="77.975998"
         id="tspan132">Gæsterne, der stiger på ved Sallingsund Færgekro, </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 16.634501 21.9165 24.557501 29.8395 35.644001 44.0895 49.894001 55.175999 58.083 61.7785 64.419502 67.060501 69.967499 75.249496 78.945 81.851997 85.547501 90.829498 96.634003 101.916 104.823 113.2685 118.5505 124.355 127.262 130.9575 133.5985 136.2395 139.1465 146.00549 150.75549 156.03751 161.842 167.6465 170.28751 176.092 181.8965 184.53751 187.4445 193.24899 197.99899 203.8035 207.49899 210.40601 216.21049 221.49249"
         y="90.972"
         id="tspan134">er velkomne til at tage med til Nykøbing, hvor de </tspan><tspan
         x="0 5.2820001 10.564 16.3685 19.275499 22.971001 28.253 34.057499 39.3395 42.246498 48.050999 52.800999 58.605499 64.410004 68.105499 71.801003 77.083 82.887497 85.794502 89.489998 92.130997 94.772003 100.5765 105.8585 111.663 116.945 119.852 123.5475 126.1885 128.8295 131.7365 136.4865 141.76849 144.4095 147.05051 149.6915 155.496 161.30051 164.996 170.80051 176.605 182.4095 185.3165 190.5985 193.2395 195.88049 198.78751 204.0695 209.3515 211.99249 217.27451 222.5565"
         y="103.968"
         id="tspan136">kan tage bybussen tilbage til Sallingsund kl. 20.15 </tspan><tspan
         x="0 5.8045001 9.5 14.782 18.477501 21.1185 24.813999"
         y="116.964"
         id="tspan138">gratis.</tspan></text>

    <text

       id="text172"><tspan
         x="0 6.8590002 12.141 15.8365 18.7435 23.4935 27.188999 29.83 38.275501 40.9165 46.198502 49.894001 52.800999 61.246498 66.528503 72.333 75.239998 78.935501 87.380997 90.022003 95.304001 98.999496 101.9065 104.5475 107.4545 112.2045 114.8455 123.291 126.9865 129.6275 135.43201 139.1275 144.93201 150.214 156.01849 158.6595 161.5665 170.5345 175.8165 181.621 184.528 188.2235 193.50549 199.31 205.1145 210.3965 214.092"
         y="0"
         id="tspan150">Det vrimler med sæler i Limfjorden. Man regner </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 27.721001 33.525501 36.432499 42.237 47.519001 51.2145 54.91 60.192001 65.996498 71.801003 74.708 80.512497 85.794502 88.7015 93.983498 96.624496 101.9065 107.1885 112.4705 115.3775 119.073 127.5185 130.1595 135.4415 138.26489 140.9059 143.8129 149.09489 154.8994 157.8064 161.50191 165.1974 167.83839 173.6429 179.4474 182.08839 187.8929 193.6974 196.6044 202.40891 207.6909 210.5979 213.23891 219.0434 222.73891 228.0209 231.7164"
         y="12.996"
         id="tspan152">med en bestand på 2.700 sæler, en stigning på intet </tspan><tspan
         x="0 8.4455004 11.0865 16.891001 22.695499 26.391001 31.673 34.580002 39.862 45.6665 51.471001 54.377998 59.66 64.942001 67.848999 73.653503 77.348999 83.153503 87.371498 92.653503 98.458 102.1535 105.0605 108.756 111.397 117.2015 122.4835 128.28799 131.19501 136.47701 141.759 147.041 152.323 154.964 157.871 166.839 172.121 177.92551 183.73 189.01199 191.91901 197.201 200.8965 203.8035 209.608 212.24899 215.9445 219.64 224.922"
         y="25.992001"
         id="tspan154">mindre end 80 procent siden 2010. Mange af disse </tspan><tspan
         x="0 5.8045001 11.609 14.25 20.054501 25.3365 29.032 31.938999 35.634499 38.275501 40.9165 43.823502 49.627998 54.91 57.817001 63.621498 66.262497 68.903503 74.708 80.512497 85.794502 89.489998 95.294502 101.099 103.74 106.647 111.397 119.8425 122.4835 127.7655 131.461 137.2655 142.5475 145.4545 148.0955 150.7365 156.541 162.3455 167.6275 171.323 174.23 177.92551 183.73 192.17551 195.0825 200.88699 204.5825 208.278 213.56 217.25549 220.951"
         y="38.987999"
         id="tspan156">holder til på Blinderøn. Sælerne ligger som oftest </tspan><tspan
         x="0 2.641 5.5479999 9.2434998 12.939 18.7435 22.438999 27.721001 30.628 36.432499 40.127998 45.932499 51.737 57.5415 62.823502 66.518997 69.426003 75.230499 81.035004 83.942001 86.583 91.864998 96.614998 101.897 105.5925 108.4995 114.304 119.586 122.493 128.2975 130.93851 133.5795 139.384 145.18851 150.4705 154.166 159.9705 165.77499 168.68201 174.4865 179.76849 182.4095 187.6915 190.5985 195.88049 199.576 204.858 208.5535 211.1945 214.1015 216.74249"
         y="51.984001"
         id="tspan158">i store grupper og lever på Blinderøn hele året. I </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 12.673 21.1185 23.759501 29.563999 34.846001 37.752998 43.035 46.730499 49.637501 55.442001 61.246498 63.887501 68.637497 73.919502 79.723999 85.528503 90.810501 93.4515 96.358498 102.163 106.913 112.7175 116.413 119.32 123.0155 131.461 134.10201 139.384 143.0795 148.884 154.166 157.8615 160.76849 166.573 172.3775 178.18201 183.9865 186.6275 192.43201 196.1275 199.823 203.51849 208.80051 214.605 219.88699 223.5825"
         y="64.980003"
         id="tspan160">tilfælde af højvande, hvor sælernes opholdssteder </tspan><tspan
         x="0 5.8045001 10.5545 15.8365 19.532 23.227501 27.977501 33.782001 42.227501 50.673 55.955002 59.650501 62.2915 65.198502 68.893997 74.176003 76.817001 79.458 84.739998 88.435501 91.342499 97.147003 102.429 106.1245 109.0315 114.3135 120.118 123.025 128.30701 132.0025 135.698 140.98 146.7845 150.48 156.2845 159.98 162.88699 171.3325 176.6145 182.41901 185.326 193.7715 199.576 202.217 204.858 210.66251 216.467 221.74899 227.5535"
         y="77.975998"
         id="tspan162">oversvømmes, sejles der en aftentur med mulighed </tspan><tspan
         x="0 3.6954999 9.5 13.1955 16.102501 21.384501 25.08 27.987 33.7915 39.073502 44.877998 50.682499 56.487 60.182499 65.4645 68.371498 74.176003 79.458 82.364998 86.060501 88.7015 94.505997 98.2015 101.897 107.179 110.086 118.5315 124.336 126.977 132.259 135.9545 139.64999 144.93201 148.6275 157.073 162.8775 166.573 171.855 174.67841 177.3194"
         y="90.972"
         id="tspan164">for at beundre de flotte molerskrænter. </tspan><tspan
         x="0 6.8590002 10.5545 16.358999 21.641001 27.445499 33.25 36.157001 39.852501 43.548 48.830002 51.737 58.596001 63.346001 68.627998 74.432503 80.237 82.877998 88.682503 94.487 97.393997 104.253 109.535 114.285 120.0895 122.9965 128.2785 130.91949 133.5605 136.4675 141.7495 147.03149 149.6725 154.9545 160.2365 162.8775 165.7845 171.589 174.23 179.51199 187.9575 193.2395 199.04401 207.4895 211.185 214.88049 217.78751 223.0695 225.71049 228.3515"
         y="103.968"
         id="tspan166">Afgang fra Nykøbing Havn kl. 18.00, hjemkomst kl. </tspan><tspan
         x="0 5.2820001 10.564 13.205 18.487 23.768999 26.41 29.316999 36.175999 39.871498 43.567001 48.848999 54.6535 58.348999 66.794502 72.0765 77.880997 80.788002 86.07 91.351997 97.156502 100.0635 105.3455 111.15 116.9545 122.2365 125.932 128.573 131.48 136.23 140.98 143.621 149.42551 154.7075 159.9895 165.2715 173.717 176.62399 180.3195 184.015 189.297 195.1015 198.797 201.70399 205.39951 211.20399 219.64951"
         y="116.964"
         id="tspan168">21.00. Aftensmad kan købes: Svinekam stegt som </tspan><tspan
         x="0 4.75 7.3909998 10.032 15.8365 19.532 22.438999 30.884501 36.1665 41.971001 44.877998 48.573502 51.2145 53.855499 59.66 64.942001 70.746498 76.551003 79.373451 82.01445 84.921448 90.725952 96.00795 99.703453 104.98545 108.68095 112.37645 117.65845 121.35395 124.26095 132.70645 138.51096 141.15195 146.43394 151.71594 156.99796 162.80244 168.08446"
         y="129.96001"
         id="tspan170">vildt med tilbehør, herefter æblekage.</tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,75.1082,275.9387)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text200"><tspan
         x="0 4.75 10.032 12.673 15.314 18.221001 26.6665 31.9485 37.752998 40.66 44.355499 46.996498 49.637501 52.544498 57.294498 59.935501 64.685501 70.489998 73.130997 76.038002 82.897003 88.179001 93.983498 96.890503 99.531502 102.1725 104.8135 107.4545 112.7365 115.6435 121.448 124.355 129.63699 133.3325 136.2395 142.04401 144.685 147.326 151.0215 154.717 157.358 159.99899 162.90601 166.6015 171.8835 174.7905 180.595 185.877 191.6815"
         y="0"
         id="tspan182">Sejl med til Livø. Den lille ø er bilfri, så den </tspan><tspan
         x="0 2.641 8.4455004 14.25 20.054501 24.804501 30.608999 35.890999 39.586498 42.4935 46.188999 48.830002 51.471001 54.377998 60.182499 65.987 71.791496 77.073502 79.980499 84.730499 90.012497 95.817001 101.6215 105.317 110.599 114.2945 120.099 123.7945 129.07651 131.7175 134.6245 141.48351 147.28799 153.0925 158.3745 162.07001 166.82001 172.10201 174.743 178.43851 181.3455 186.6275 190.323 193.23 199.0345 204.3165 208.01199 210.91901 214.6145 217.25549 223.06"
         y="12.996"
         id="tspan184">indbyder til gode vandreture. Undervejs er der rig </tspan><tspan
         x="0 8.4455004 14.25 16.891001 19.532 25.3365 31.141001 36.423 42.227501 45.134499 48.830002 54.634499 58.330002 61.237 66.518997 70.2145 73.121498 76.817001 82.098999 85.005997 88.7015 97.147003 99.788002 105.07 107.8934 110.5344 113.4414 117.1369 122.9414 128.2234 132.44141 135.0824 140.3644 143.0054 146.7009 149.60789 155.4124 160.6944 163.60139 169.4059 174.6879 180.4924 183.3994 187.09489 190.79041 196.0724 201.87691 207.15891 212.96339 218.24541 221.1524 226.95689 232.7614"
         y="25.992001"
         id="tspan186">mulighed for at se sæler, specielt på den fredede og </tspan><tspan
         x="0 5.8045001 9.5 12.141 14.782 20.5865 29.032 34.836498 40.640999 45.923 48.563999 51.205002 57.009499 62.2915 65.198502 69.948502 72.5895 77.3395 83.143997 86.051003 90.630951 95.912949 101.71745 104.35845"
         y="38.987999"
         id="tspan188">utilgængelige Livø Tap. </tspan><tspan
         x="0 6.8590002 12.141 15.8365 18.7435 24.548 27.188999 29.83 34.580002 39.862 43.557499 46.4645 50.682499 55.9645 58.605499 61.512501 66.794502 69.7015 73.397003 76.038002 84.483498 89.765503 93.460999 97.156502 100.0635 105.868 111.6725 117.477 123.2815 125.9225 131.72701 134.634 140.43851 145.7205 148.6275 154.43201 159.714 165.51849 168.1595 171.0665 176.871 182.67551 185.5825 189.278 192.9735 198.778 204.06 209.8645 213.56 217.25549 222.53751 228.342"
         y="51.984001"
         id="tspan190">Der bliver ca. 3 timers ophold på øen, og frokosten </tspan><tspan
         x="0 5.8045001 11.0865 13.9935 18.7435 21.384501 26.134501 31.938999 34.846001 40.127998 45.41 51.2145 54.121498 59.925999 65.208 68.903503 72.598999 75.239998 77.880997 80.522003 85.804001 89.499496 92.406502 98.210999 103.493 109.2975 115.102 120.384 128.8295 131.7365 140.7045 146.509 150.2045 153.89999 159.7045 162.6115 167.19051 172.995 176.69051 179.3315 183.02699 186.7225 192.52699 198.3315 202.02699 207.30901 212.591 218.39549 221.0365"
         y="64.980003"
         id="tspan192">på Livø kan bestilles gennem Morsø Turistbureau. </tspan><tspan
         x="0 8.9680004 14.25 20.054501 22.9615 28.2435 31.938999 34.846001 40.650501 46.455002 50.150501 55.432499 58.3395 63.0895 68.371498 71.012497 76.294502 82.098999 90.544502 98.989998 104.272 110.0765 112.9835 116.679 119.32 121.961 124.868 128.56351 133.8455 136.4865 141.2365 144.14349 149.42551 153.121 156.028 164.4735 169.75549 175.56 181.3645 185.06 187.701 193.50549 199.31 204.592"
         y="77.975998"
         id="tspan194">Man er også velkommen til selv at medbringe </tspan><tspan
         x="0 3.6954999 7.3909998 13.1955 18.477501 24.282 27.977501 31.673 36.955002 42.759499 46.455002 50.502949 53.143951 56.050949 62.90995 68.191948 71.887451 74.794449 80.076447 83.77195 86.678947 95.124451 100.92895 103.56995 106.21095 112.01545 115.71095 118.61795 123.89995 127.59545 130.50246 136.30695 142.11145 147.91595 153.72044 159.00246 161.90945 167.19145 170.88695 173.79395 179.59845 184.88045 187.78745 192.53745 198.34195 201.16534 203.80635 206.71335 215.68135 220.96335 226.76785"
         y="90.972"
         id="tspan196">frokostkurv. Det er muligt at hoppe af på Fur. Man </tspan><tspan
         x="0 5.2820001 10.564 16.3685 19.275499 22.971001 28.253 34.057499 39.3395 42.246498 46.4645 51.2145 56.496498 61.7785 64.419502 67.060501 72.864998 78.147003 81.842499 87.647003 92.929001 97.679001 103.4835 109.288 115.0925 117.9995 126.445 131.72701 137.53149 140.43851 146.243 151.52499 154.43201 158.1275 163.93201 167.6275 172.9095 178.714 181.621 185.3165 191.121 194.8165 197.7235 203.00549 205.8289 208.46989 211.37691 216.65891 221.9409 224.58189 227.74541 230.3864"
         y="103.968"
         id="tspan198">kan tage cykel/barnevogn med på turen for kr. 50,-. </tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text306"><tspan
         x="0 4.579 10.3835 14.079 19.361 25.165501 28.0725 31.768 37.572498 43.376999 49.181499 52.876999 55.784 61.588501 70.033997 72.941002 81.908997 87.713501 91.408997 95.1045 98.011497 103.816 108.566 114.3705 119.6525 123.348 126.255 132.05949 137.34151 140.2485 145.5305 151.33501 156.617 160.3125 164.008 169.28999 174.57201 180.3765 186.181 191.463"
         y="0"
         id="tspan284">Turen rundt om Mors byder på enestående </tspan><tspan
         x="0 5.8045001 11.0865 14.782 20.5865 24.282 27.977501 32.195499 37.477501 43.282001 48.563999 52.259499 54.900501 60.182499 63.005901 65.646896 68.553902 73.303902 78.585899 84.390404 90.194901 93.890404 99.172401 104.4544 110.2589 115.5409 119.2364 122.1434 125.8389 131.1209 133.7619 137.4574 141.15289 146.43491 150.1304 153.0374 156.73289 160.42841 165.7104 168.6174 174.42191 180.22639 183.92191 189.72639 192.63341 196.3289 198.96989 201.6109 204.5179 208.21339 212.96339 218.7679 221.40891"
         y="12.996"
         id="tspan286">naturscenerier. Landskabet skifter fra nord til syd. </tspan><tspan
         x="0 4.75 8.4455004 13.7275 16.634501 22.438999 27.721001 31.4165 34.323502 40.127998 45.41 49.105499 52.800999 58.083 63.365002 66.272003 69.967499 72.608498 75.249496 78.156502 83.960999 89.242996 92.938499 95.845497 101.65 104.291 106.932 112.7365 118.0185 120.9255 126.73 132.5345 135.4415 139.13699 142.8325 148.1145 151.0215 153.66251 158.9445 163.6945 168.9765 171.8835 175.57899 179.27451 182.97 188.252 194.0565 199.86099 205.14301 210.94749 216.752 222.034"
         y="25.992001"
         id="tspan288">Fra det barske til det blide og fra lave strandenge </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 15.58 20.862 23.768999 29.051001 31.691999 34.333 40.137501 43.833 49.115002 51.9384 54.579399 57.486401 63.290901 68.572899 72.268402 75.1754 78.870903 84.152901 86.7939 90.489403 95.7714 99.466904 102.3739 106.0694 108.7104 114.5149 117.4219 123.2264 131.67191 135.3674 143.8129 149.09489 152.79041 156.4859 159.3929 162.03391 167.83839 173.6429 177.33839 182.62041 186.3159 189.2229 195.0274 200.83189 203.73891 209.0209 212.7164"
         y="38.987999"
         id="tspan290">til rå klinter, der rejser sig nærmest lodret op af </tspan><tspan
         x="0 3.6954999 6.3365002 12.141 15.8365 21.641001 26.923 32.727501 35.3685"
         y="51.984001"
         id="tspan292">fjorden. </tspan><tspan
         x="0 4.75 8.4455004 14.25 19.532 25.3365 29.032 32.727501 38.532001 43.813999 49.6185 53.313999 58.596001 64.400497 67.307503 73.112 78.916496 81.557503 87.362 92.643997 96.3395 99.246498 103.9965 109.2785 115.083 117.99 125.381 129.07651 132.772 135.679 141.84544 144.48645 147.12746 152.93195 156.62746 162.43195 168.23645 174.04095 176.94795 183.80695 186.44795 189.08894"
